ណោះ។)','Email&nbsp;Address:'=>'អាសយដ្ឋាន&nbsp;អ៊ីមែល:','There was a problem, please correct the form below and try again.'=>'មាន​បញ្ហា​កើត​ឡើង សូម​កែ​បែបបទ​ខាង​ក្រោម ហើយ​ព្យាយាម​ម្ដង​ទៀត។','Get your own %s account in seconds'=>'ទទួល​យក​គណនី %s របស់​អ្នក','Just a username, please.'=>'ត្រឹម​តែ​ឈ្មោះ​អ្នក​ប្រើ បាន​ហើយ។','%s is your new username'=>'%s គឺឈ្មោះ​អ្នក​ប្រើ​ថ្មី​របស់​អ្នក','But, before you can start using your new username, <strong>you must activate it</strong>.'=>'ប៉ុន្តែ មុន​ពេល​អ្នក​ចាប់​ផ្ដើម​ប្រើ​ឈ្មោះ​អ្នក​ប្រើ​ថ្មី​របស់​អ្នក, <strong>អ្នក​ត្រូវ​តែ​បើក​ដំណើរ​ការ​វា​សិន</strong>។','If you do not activate your username within two days, you will have to sign up again.'=>'ប្រសិន​បើ​អ្នក​មិន​បើក​ដំណើរ​ការ​ឈ្មោះ​អ្នក​ប្រើ​របស់​​អ្នក​ក្នុង​រយៈពេល​ពីរ​ថ្ងៃ,​ អ្នក​នឹង​ត្រូវ​​ចុះ​ឈ្មោះ​ម្ដង​ទៀត។','Signup'=>'ចុះ​ឈ្មោះ','Still waiting for your email?'=>'នៅ​តែ​កំពុង​រង់​ចាំ​អ៊ីមែល​របស់​អ្នក?','Registration has been disabled.'=>'ការ​ចុះឈ្មោះ​ត្រូវ​បានបិទ។','User registration has been disabled.'=>'ការ​ចុះ​ឈ្មោះ​អ្នក​ប្រើប្រាស់​ត្រូវ​បាន​បិទ។','The site %s is yours.'=>'វេបសាយ %s គឺ​ជា​របស់​អ្នក។','Create Site'=>'បង្កើត​វេបសាយ','If you&#8217;re not going to use a great site domain, leave it for a new user. Now have at it!'=>'បើ​អ្នក​មិន​ប្រើ​ដូមេន​វេបសាយ​ទេ សូម​ទុក​វា​សម្រាប់​អ្នក​ប្រើ​ថ្មី។','Sites you are already a member of:'=>'វេបសាយ​ដែល​អ្នក​បាន​ចូល​ជា​សមាជិក:','Site Title:'=>'ឈ្មោះ​វេបសាយ:','Site Domain:'=>'ដូមេន​វេបសាយ:','Site Name:'=>'ឈ្មោះ​វេបសាយ:','sitename'=>'ឈ្មោះ​វេបសាយ','Get <em>another</em> %s site in seconds'=>'ទទួល​យក​វេបសាយ %s <em>មួយ​ទៀត</em> តែ​ប៉ុន្មាន​វិនាទី​ប៉ុណ្ណោះ','Congratulations! Your new site, %s, is almost ready.'=>'សូម​អបអរ​សាទរ! វេបសាយ​ថ្មី​របស់​អ្នក, %s, ជិត​រួច​រាល់​ហើយ។','Site registration has been disabled.'=>'ការ​ចុះ​ឈ្មោះ​វេបសាយ​ត្រូវ​បាន​បិទ។','One response to %s'=>'ការឆ្លើយតបមួយទៅ %s','Gimme a site!'=>'ឲ្យ​វេបសាយ​ខ្ញុំ​មួយ!','But, before you can start using your site, <strong>you must activate it</strong>.'=>'ប៉ុន្តែ​មុន​ពេល​អ្នក​អាច​ចាប់​ផ្ដើម​ប្រើប្រាស់​វេបសាយ​របស់អ្នក <strong>អ្នក​ត្រូវ​តែ​ធ្វើ​វា​ឲ្យ​សកម្ម</strong>។','If you do not activate your site within two days, you will have to sign up again.'=>'បើ​អ្នក​មិន​ទាន់​បើក​ដំណើរការ​វេបសាយ​របស់​អ្នក​ក្នុងកំឡុង​ពេល​ពីរ​ថ្ងៃ អ្នក​នឹង​ត្រូវ​ចុះ​ឈ្មោះ​ម្ដង​ទៀត។','Sorry, that site already exists!'=>'សូម​ទោស, វេបសាយ​នោះ​មាន​រួច​ហើយ។','Must be at least 4 characters, letters and numbers only. It cannot be changed, so choose carefully!'=>'ត្រូវ​តែ​យ៉ាង​តិច 4 តួ, ប្រើ​បាន​តែ​អក្សរ និង​លេខ​ប៉ុណ្ណោះ។ មិន​អាច​ប្ដូរ​វា​នៅ​ពេល​ក្រោយ​បាន​ទេ ដូច្នេះ​សូម​រើស​ឲ្យ​បាន​ប្រុង​ប្រយ័ត្ន!','You must first <a href="%s">log in</a>, and then you can create a new site.'=>'អ្នក​ត្រូវ​តែ <a href="%s">កត់​ឈ្មោះ​ចូល</a> ជា​មុន​សិន ទើប​អាច​បង្កើត​វេបសាយ​ថ្មី​មួយ​បាន។','Links for %s'=>'តំណ​សម្រាប់ %s','An error occurred adding you to this site. Back to the <a href="%s">homepage</a>.'=>'មាន​កំហុស​ក្នុង​ការ​បន្ថែម​អ្នក​ទៅ​វេបសាយ​នេះ​។ ត្រឡប់ទៅ <a href="%s">ទំព័រដើម</a>។','New Site Registration: %s'=>'ការ​ចុះ​ឈ្មោះ​វេបសាយ​ថ្មី: %s','You are logged in already. No need to register again!'=>'អ្នក​បាន​កត់​ឈ្មោះ​ចូល​រួច​ហើយ។ មិន​ត្រូវ​ការ​ចុះ​ឈ្មោះ​ម្ដង​ទៀត​ទេ!','F, Y'=>'F, Y','Sorry, new registrations are not allowed at this time.'=>'សូម​ទោស ការ​ចុះ​ឈ្មោះ​មិន​ត្រូវ​បាន​អនុញ្ញាត​ទេ​នៅ​ពេល​នេះ។','The given object ID is not that of a menu item.'=>'អត្តលេខ​ដែល​បាន​ផ្ដល់ គឺ​មិន​មែន​របស់​ធាតុ​ម៉ឺនុយ​ទេ។','Welcome back, %s. By filling out the form below, you can <strong>add another site to your account</strong>. There is no limit to the number of sites you can have, so create to your heart&#8217;s content, but write responsibly!'=>'សូម​ស្វាគមន៍​ការ​ត្រឡប់​មក​វិញ, %s។ ការ​បំពេញ​បែបបទ​ខាង​ក្រោម​នេះ អ្នក​អាច <strong>បន្ថែម​វេបសាយ​មួយ​ទៀត​ទៅ​គណនី​របស់​អ្នក</strong>។ អ្នក​អាច​បង្កើត​វេបសាយ​បាន​ដោយ​គ្មាន​កំណត់ ដូច្នេះ​អ្នក​អាច​បង្កើត​បាន​តាម​បំណង ប៉ុន្តែ​សូម​សរសេរ​ដោយ​ទំនួល​ខុស​ត្រូវ!','If you haven&#8217;t received your email yet, there are a number of things you can do:'=>'បើ​សិន​អ្នក​មិន​បាន​ទទួល​អ៊ីមែល​របស់​អ្នក​ទេ អ៊ីចឹង​មាន​រឿង​ខ្លះ​ដែល​អ្នក​អាច​ធ្វើ:','New %1$s Site: %2$s'=>'វេបសាយ %1$s ថ្មី: %2$s','The site is already active.'=>'វែបសាយ​នេះ​បានធ្វើ​អោយសកម្មរួចហើយ។','Sorry, site names must have letters too!'=>'សូម​ទោស, ឈ្មោះ​វេបសាយ​ក៏​ត្រូវ​មាន​អក្សរ​ដែរ!','Sorry, you may not use that site name.'=>'សូម​ទោស, អ្នក​មិន​អាច​ប្រើ​ឈ្មោះ​វេបសាយ​នោះ​ទេ។','Sorry, that site is reserved!'=>'សូម​ទោស, វេបសាយ​នោះ​ត្រូវ​បាន​បម្រុង​ទុក!','That site is currently reserved but may be available in a couple days.'=>'វេបសាយ​នោះ​កំពុង​ត្រូវ​បាន​បម្រុង​ទុក ប៉ុន្តែ​នឹង​មាន​វត្តមាន​វិញ​ក្នុង​រយៈ​ពេល​ប៉ុន្មាន​ថ្ងៃ​ទៀត។','%1$s is proudly powered by %2$s'=>'%1$s ត្រូវ​បាន​ឧបត្ថម្ភ​ដោយ %2$s','Wait a little longer. Sometimes delivery of email can be delayed by processes outside of our control.'=>'សូម​រង់ចាំ​យូរ​បន្តិច។ ពេល​ខ្លះ​ការ​ផ្ញើ​អ៊ីមែល​អាច​នឹង​ត្រូវ​បាន​ពន្យារ​ដោយ​សារ​ដំណើរ​ការ​ដែល​ស្ថិត​នៅ​ក្រៅ​ការគ្រប់គ្រង​របស់​យើង។','Check the junk or spam folder of your email client. Sometime emails wind up there by mistake.'=>'សូម​មើល​ថត​ស្ប៉ាម​ឬ​សំរាម​នៅ​ក្នុង​អ៊ីមែល​របស់​អ្នក។ ពេល​ខ្លះ​អ៊ីមែល វា​រត់​ចូល​ទៅ​ក្នុង​នោះ​ដោយ​កំហុស។','We send your registration email to this address. (Double-check your email address before continuing.)'=>'យើង​ផ្ញើ​អ៊ីមែល​ចុះ​ឈ្មោះ​របស់​អ្នក​ទៅ​អាសយដ្ឋាននេះ។ (ពិនិត្យ​អ៊ីមែល​របស់​អ្នកម្ដង​ទៀត មុន​បន្ត។)','You have searched the %1$s blog archives for <strong>&#8216;%2$s&#8217;</strong>. If you are unable to find anything in these search results, you can try one of these links.'=>'អ្នក​បាន​ស្វែង​រក %1$s បណ្ណសារ​ប្លក់​សម្រាប់ <strong>&#8216;%2$s&#8217;</strong>។ ប្រសិន​បើ​អ្នក​រក​មិន​ឃើញ​អ្វី​នៅ​ក្នុង​លទ្ធផល​ស្វែងរក​ទេ អ្នក​អាច​សាក​ល្បង​តំណ​ណាមួយ​ក្នុង​ចំណោម​តំណ​ទាំង​នេះ។','Please include a %s template in your theme.'=>'សូម​ដាក់​បញ្ចូល​ពុម្ព​គម្រូ %s នៅ​ក្នុង​រូបរាង។','Theme without %s'=>'រូបរាង​ដែល​គ្មាន %s','l, F jS, Y'=>'l, F jS, Y','You are currently browsing the archives for the %s category.'=>'អ្នក​កំពុង​តែ​រុករក​បណ្ណសារ​នៃ​ចំណាត់​ក្រុម %s ។','This post is password protected. Enter the password to view comments.'=>'ប្រកាស​នេះ​ត្រូវ​បាន​ការ​ពារ​ដោយ​ពាក្យ​សម្ងាត់។ បញ្ចូល​ពាក្យ​សម្ងាត់​ដើម្បី​មើល​មតិ។','Invalid post.'=>'ប្រកាស​មិន​ត្រឹម​ត្រូវ','Post formatAudio'=>'សំឡេង','No search term specified. Showing recent items.'=>'មិន​មាន​ពាក្យ​ស្វែង​រក​ដែល​បាន​បញ្ជាក់។ ពេល​នេះ​កំពុង​បង្ហាញ​របស់​ថ្មីៗ។','Post formatStandard'=>'ស្តង់ដារ','The user is already active.'=>'អ្នក​ប្រើប្រាស់​នេះ​សកម្ម​ហើយ។','Post formatAside'=>'សង្ខេប','Post formatChat'=>'ការ​ជជែក','Post formatGallery'=>'វិចិត្រសាល','Post formatLink'=>'តំណ','Post formatImage'=>'រូបភាព','Post formatQuote'=>'ពាក្យ​សម្រង់','Post formatStatus'=>'ស្ថានភាព','Post formatVideo'=>'វីដេអូ','Only a static class method or function can be used in an uninstall hook.'=>'មាន​តែ static class method ឬ function មួយ​ប៉ុណ្ណោះ ដែល​អាច​ប្រើ​បាន​នៅ​ក្នុង hook នៃ​ការ​លុប។','Your address will be %s.'=>'អាសយដ្ឋាន​របស់​អ្នកគឺ %s ។','domain'=>'ដូមេន','Enter the destination URL'=>'បញ្ចូល​ទិសដៅ URL','Allow search engines to index this site.'=>'អនុញ្ញាតឱ្យ​ម៉ាស៊ីន​ស្វែង​រក​បាន​ធ្វើ​លិបិក្រម​វែបសាយនេះ។','Or link to existing content'=>'ឬ​ត​ភ្ជាប់​ទៅ​មាតិកា​ដែល​មាន​ស្រាប់','Pingback:'=>'Pingback:','Link'=>'ភ្ជាប់','%1$s is your new site. <a href="%2$s">Log in</a> as &#8220;%3$s&#8221; using your existing password.'=>'%1$s គឺជាវេបសាយថ្មីរបស់អ្នក។ <a href="%2$s">ចូលប្រើ</a> ជា &#8220;%3$s&#8221; ដោយប្រើពាក្យសម្ងាត់ដែលមានស្រាប់របស់អ្នក។','Upload'=>'ផ្ទុក​ឡើង','Site name must be at least %s character.'=>'ឈ្មោះ​វេបបសាយ​ត្រូវ​មាន​យ៉ាង​តិច %s តួ​អក្សរ។','Please enter a site name.'=>'សូម​បញ្ចូល​ឈ្មោះ​វេបសាយ។','Please enter a username.'=>'សូម​បញ្ចូល​ឈ្មោះ​អ្នក​ប្រើ។','Please enter a site title.'=>'សូម​បញ្ចូល​ចំណង​ជើង​វេបសាយ។','That name is not allowed.'=>'មិន​អនុញ្ញាត​​ឲ្យ​ប្រើ​ឈ្មោះ​នោះ​ទេ។','Username must be at least 4 characters.'=>'ឈ្មោះ​អ្នក​ប្រើ ត្រូវ​តែ​មាន​យ៉ាង​តិច 4 តួ​អក្សរ។','The requested user does not exist.'=>'មិន​មាន​អ្នក​ប្រើប្រាស់​ដែល​បាន​ស្នើ​ឡើយ។','Please enter a valid email address.'=>'សូម​បញ្ចូល​អាសយដ្ឋាន​អ៊ីមែល​ដែល​ត្រឹម​ត្រូវ។','New Site: %1$s
