ត​ម៉ឺនុយ','Menu deleted'=>'បាន​លុប​ម៉ឺនុយ','Menu item moved up'=>'បាន​រុញ​ធាតុ​ម៉ឺនុយ​ឡើង','Menu item moved down'=>'បាន​រុញ​ធាតុ​ម៉ឺនុយ​ចុះ','Menu item moved out of submenu'=>'បាន​រុញ​ធាតុ​ម៉ឺនុយ​ចេញ​ពី​ម៉ឺនុយ​រង','Menu item is now a sub-item'=>'ធាតុ​ម៉ឺនុយ​បាន​ក្លាយ​ជា​ធាតុ​រង','%s (Invalid)'=>'%s (មិន​ត្រឹម​ត្រូវ)','%s (Pending)'=>'%s (កំពុង​រង់ចាំ)','Number of items found: %d'=>'ចំនួននៃធាតុដែល​បានរកឃើញ៖ %d','Additional items found: %d'=>'បាន​រក​ឃើញ​ធាតុ​បន្ថែម៖ %d','Loading more results... please wait.'=>'កំពុងផ្ទុកលទ្ធផលបន្ថែមទៀត...  មេត្តារង់ចាំ។','Move up one'=>'រុញ​ទៅ​លើ​មួយ','Move down one'=>'រុញ​ចុះ​ក្រោម​មួយ','Move to the top'=>'រុញ​ទៅ​លើ​បំផុត','Move under %s'=>'រុញ​ទៅ​នៅ​ក្រោម %s','Move out from under %s'=>'រុញ​ចេញ​ពី​ក្រោម %s','Under %s'=>'ក្រោម %s','Out from under %s'=>'ចេញ​ពី​ក្រោម %s','%1$s. Menu item %2$d of %3$d.'=>'%1$s។ ធាតុ​ម៉ឺនុយ %2$d នៃ %3$d។','%1$s. Sub item number %2$d under %3$s.'=>'%1$s។ ធាតុរងលេខ %2$d នៅក្រោម %3$s។','This panel is used for managing navigation menus for content you have already published on your site. You can create menus and add items for existing content such as pages, posts, categories, tags, formats, or custom links.'=>'ផ្ទាំង​នេះ​ត្រូវបាន​ប្រើ​ក្នុង​ការ​គ្រប់គ្រង​ម៉ឺនុយ​សម្រាប់​មាតិកា​ដែល​អ្នក​បាន​ផ្សាយ​នៅ​លើ​វេបសាយ​របស់​អ្នក។ អ្នក​អាច​បង្កើត​ម៉ឺនុយ​ថ្មី និង​បន្ថែម​ធាតុ​ចំពោះ​មាតិកា​ដែល​មាន​ស្រាប់​ដូចជា​ទំព័រ, ប្រកាស, ចំណាត់ក្រុម, ស្លាក, ទ្រង់ទ្រាយ, ឬ​តំណ​ផ្សេងៗ។','Your theme can display menus in %s location. Select which menu you would like to use.'=>'រូបរាងវេបសាយរបស់អ្នកអាចបង្ហាញម៉ឺនុយបាន %s កន្លែង។ ជ្រើសរើសកន្លែងណាមួយដែលអ្នកចង់បង្ហាញនូវម៉ឺនុយនោះ។','Menu Locations'=>'ទីតាំង​ម៉ឺនុយ','Move one level up'=>'រុញ​ឡើង​មួយ​កម្រិត','Move one level down'=>'រុញ​ចុះ​មួយ​កម្រិត','Add Menu Items'=>'បន្ថែម​ធាតុ​ម៉ឺនុយ','Search Menu Items'=>'ស្វែងរក​ធាតុ​ម៉ឺនុយ','Search menu items&hellip;'=>'ស្វែងរក​ធាតុ​ម៉ឺនុយ&hellip;','Custom Links'=>'តំណ​ផ្ទាល់​ខ្លួន','Add to Menu'=>'ដាក់​ចូល​ម៉ឺនុយ','Default shortcuts,'=>'ផ្លូវកាត់លំនាំដើម,','Additional shortcuts,'=>'ផ្លូវកាត់បន្ថែម,','Inline toolbar (when an image, link or preview is selected)'=>'របារ​ឧបករណ៍​នៅ​ជាប់ (នៅ​ពេល​បាន​ជ្រើសរើស​រូបភាព តំណ ឬ ការ​មើល​ជាមុន)','Ctrl + Alt + letter:'=>'Ctrl + Alt + ឣក្សរ៖','Shift + Alt + letter:'=>'Shift + Alt + ឣក្សរ៖','Cmd + letter:'=>'Cmd + ឣក្សរ៖','Ctrl + letter:'=>'Ctrl + ឣក្សរ៖','Close reorder mode'=>'បិទ​ការ​តម្រៀប','Menus can be displayed in locations defined by your theme or in <a href="%s">widget areas</a> by adding a &#8220;Navigation Menu&#8221; widget.'=>'ម៉ឺនុយ​អាច​បង្ហាញ​នៅ​ក្នុង​ទីតាំង​ទាំងឡាយ​ណា​ដែល​កំណត់​ដោយ​រូបរាង​ដែល​អ្នក​យក​មក​ប្រើ ឬ​បង្ហាញ​នៅ​ក្នុង​<a href="%s">តំបន់​វិដជិត</a>​ ដោយ​បន្ថែម​វិដជិត &#8220;ម៉ឺនុយ​ផ្ទាល់​ខ្លួន&#8221;។','Menus can be displayed in locations defined by your theme.'=>'ម៉ឺនុយ​អាច​បង្ហាញ​នៅ​ទីតាំង​ដែល​មាន​កំណត់​នៅ​ក្នុង​រូបរាង។','Add to menu: %1$s (%2$s)'=>'ដាក់​ចូល​ម៉ឺនុយ៖ %1$s (%2$s)','When starting a new paragraph with one of these formatting shortcuts followed by a space, the formatting will be applied automatically. Press Backspace or Escape to undo.'=>'នៅ​ពេល​ចាប់ផ្ដើម​កថាខណ្ឌ​ថ្មី​ជាមួយ​ផ្លូវកាត់​នៃ​ការ​រៀបចំ​ទ្រង់ទ្រង់​ណាមួយ​នោះ ដោយ​មាន​ប្រើ​ដំណកឃ្លា​ពី​ក្រោយ, ការ​រៀបចំ​ទ្រង់ទ្រាយ​នឹង​អនុវត្ត​ដោយ​ស្វ័យប្រវត្តិ។ ចុច Backspace ឬ Escape ដើម្បី​មិនធ្វើ​វិញ។','No items'=>'គ្មានធាតុ','Menu Name'=>'ឈ្មោះម៉ឺនុយ','Toggle section: Custom Links'=>'បិទ​បើក​ភ្នែក៖ តំណ​ផ្ទាល់​ខ្លួន','The post type %1$s is not registered, so it may not be reliable to check the capability "%2$s" against a post of that type.'=>'ប្រភេទ​ប្រកាស %1$s មិន​ទាន់​ចុះ​បញ្ជី​នៅ​ឡើយ​ទេ ដូច្នេះ​ហើយ​មិន​អាច​ពិនិត្យ​មើល​លទ្ធភាព "%2$s" ដែល​ប្រើ​ចំពោះ​ប្រភេទ​ប្រកាស​នោះ​ឡើយ។','Usernames can only contain lowercase letters (a-z) and numbers.'=>'ឈ្មោះ​អ្នកប្រើ អាច​មាន​តែ​តួអក្សរ​តូច (a-z) និង​លេខ​តែ​ប៉ុណ្ណោះ។','Site names can only contain lowercase letters (a-z) and numbers.'=>'ឈ្មោះ​វេបសាយ​អាច​មាន​តែ​អក្សរ​តូច (a-z) និង​លេខ​តែ​ប៉ុណ្ណោះ។','Site Language:'=>'ភាសា​វេបសាយ៖','Oops! That embed can&#8217;t be found.'=>'អូ៎! រក​មិន​ឃើញ​វត្ថុ​បង្កប់​នោះ​ទេ។','It looks like nothing was found at this location. Maybe try visiting %s directly?'=>'ដូច​ជា​រក​អ្វី​មិន​ឃើញ​សោះ​នៅ​ទីតាំង​នេះ។ សាកល្បង​ចូល​មើល %s ដោយ​ផ្ទាល់​ទៅ​មើល៍?','The site you were looking for, %s, does not exist.'=>'វេបសាយ​ដែល​អ្នក​កំពុង​រក​នេះ (%s) មិនមាន​ទេ។','The menu name %s conflicts with another menu name. Please try another.'=>'ឈ្មោះម៉ឺនុយ%s ប្រឆាំងជាមួយឈ្មោះម៉ឺនុយផ្សេងទៀត។ សូមសាកល្បង ១ផ្សេងទៀត។','Check your inbox at %s and click the link given.'=>'ពិនិត្យ​មើល​ប្រអប់​សំបុត្រ​របស់​អ្នក​នៅ %s ហើយ​ចុច​តំណ​ដែល​មាន​នៅ​ក្នុង​នោះ។','You are currently browsing the %1$s blog archives for the day %2$s.'=>'អ្នក​កំពុង​រក​មើល​ក្នុង​ប័ណ្ណសារ​ប្លក់ %1$s សម្រាប់​ថ្ងៃ %2$s។','You are currently browsing the %1$s blog archives for %2$s.'=>' អ្នក​កំពុង​រក​មើល​ក្នុង​ប័ណ្ណសារ​ប្លក់ %1$s សម្រាប់ %2$s។','You are currently browsing the %1$s blog archives for the year %2$s.'=>' អ្នក​កំពុង​រក​មើល​ក្នុង​ប័ណ្ណសារ​ប្លក់ %1$s សម្រាប់​ឆ្នាំ %2$s។','You are currently browsing the %s blog archives.'=>'អ្នក​កំពុង​រក​មើល​ក្នុង​ប័ណ្ណសារ​ប្លក់ %s។','menu(Currently set to: %s)'=>'(បច្ចុប្បន្ន កំណត់​ឲ្យ៖ %s)','Paste URL or type to search'=>'បិទ​ភ្ជាប់ URL ឬ​ក៏​វាយ​បញ្ចូល ដើម្បី​ស្វែងរក','The next group of formatting shortcuts are applied as you type or when you insert them around plain text in the same paragraph. Press Escape or the Undo button to undo.'=>'ក្រុម​ផ្លូវកាត់​សម្រាប់​ការ​រៀបចំ​ទ្រង់ទ្រាយ ដែល​នៅ​បន្ទាប់​នេះ​នឹង​ត្រូវ​អនុវត្ត​នៅ​ពេល​ណា​អ្នក​វាយ​អក្សរ ឬ​នៅ​ពេល​អ្នក​បញ្ចូល​ពួកវា​ទៅ​លើ​អក្សរ​នៅ​ក្នុង​កថាខណ្ឌ​ជាមួយ​គ្នា។ ចុច Escape ឬ ប៊ូតុង​មិន​ធ្វើ​វិញ ដើម្បី​បក​ក្រោយ។','Link options'=>'ជម្រើស​តំណ','Rich Text Area. Press Control-Option-H for help.'=>'តំបន់អត្ថបទដ៏សម្បូរបែប។ ចុច Control-Option-H សម្រាប់ជំនួយបន្ថែម។','Warning: the link has been inserted but may have errors. Please test it.'=>'បំរាម៖ តំណភ្ជាប់ត្រូវបានបញ្ជូល ប៉ុន្តែប្រហែលនៅមានកំហុស។ សូមសាកល្បងវាសិន។','Post'=>'ប្រកាស','%1$s could not be created: %2$s'=>'%1$s មិនអាចបង្កើតជា: %2$s','Empty title'=>'ចំនងជើងទទេរ','Status is forbidden'=>'ស្ថានភាពត្រូវបានហាមឃាត់','New site notification email subject[%1$s] Activate %2$s'=>'[%1$s] ធ្វើឲ្យសកម្ម %2$s','New user notification email subject[%1$s] Activate %2$s'=>'[%1$s] ធ្វើឲ្យសកម្ម %2$s','Short for red in RGBR'=>'R','Short for green in RGBG'=>'G','Short for blue in RGBB'=>'B','The URL of the resource for which to fetch oEmbed data.'=>'URL នៃប្រភពសម្រាប់ទាញយកទិន្នន័យពី ទិន្នន័យ oEmbed។','The oEmbed format to use.'=>'ទម្រង់ oEmbed ដើម្បីប្រើប្រាស់។','The maximum width of the embed frame in pixels.'=>'ប្រវែងអតិបរមានៃហ្វ្រេមដែលដាក់ភ្ជាប់គិតជាភីកសែល។','The maximum height of the embed frame in pixels.'=>'កម្ពស់អតិបរមានៃហ្វ្រេមដែលដាក់ភ្ជាប់គិតជាភីកសែល។','Whether to perform an oEmbed discovery request for non-whitelisted providers.'=>'ថាតើត្រូវធ្វើការស្នើរសុំរកតាម oEmbed សម្រាប់អ្នកផ្តល់សេវាដែលស្ថិតនៅបញ្ជីខ្មៅ។','Sorry, you are not allowed to make proxied oEmbed requests.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យធ្វើឱ្យសំណើរលើ oEmbed ប្រូកស៊ីឡើយ។','Greetings Network Administrator!'=>'ស្វាគមន៍អ្នកគ្រប់គ្រងបណ្តាញ!','The network currently disallows registrations.'=>'ប្រព័ន្ធបណ្តាញនាពេលបច្ចុប្បន្ននេះមិនអនុញ្ញាត​អោយមានការចុះបញ្ជីនោះទេ។','The network currently allows site registrations.'=>'ពេលនេះប្រព័ន្ធបណ្តាញអនុញ្ញាតឲ្យវេបសាយអាចចុះឈ្មោះបាន។','The network currently allows user registrations.'=>'ពេលនេះប្រព័ន្ធបណ្ដាញអនុញ្ញាតឱ្យអ្នកប្រើប្រាស់អាចចុះឈ្មោះបាន។','The network currently allows both site and user registrations.'=>'ពេលនេះប្រព័ន្ធបណ្តាញអនុញ្ញាតឲ្យទាំងវេបសាយ និងអ្នកប្រើ អាចចុះឈ្មោះបាន។','To change or disable registration go to your <a href="%s">Options page</a>.'=>'ដើម្បីប្តូរឬបិទការចុះបញ្ជីសូមចូលទៅកាន់ <a href="%s">Options page</a> របស់អ្នក។','Your theme can display menus in one location.'=>'រូបរាងវេបសាយរបស់អ្នកអាចបង្ហាញម៉ឺនុយបាន ១ កន្លែង។','Your theme can display menus in %s location.'=>'រូបរាងវេបសាយរបស់អ្នកអាចបង្ហាញម៉នុយបានចំនួន %s កន្លែង។','If your theme has multiple menus, giving them clear names will help you manage them.'=>'ប្រសិនបើរូបរាងវេបសាយរបស់អ្នកមានម៉ឺនុយច្រើន នោះការដាក់ឈ្មោះពួកវាឲ្យបានច្បាស់លាស់នឹងជួយអ្នកក្នុងការគ្រប់គ្រងបានស្រួល។','New Menu'=>'ម៉ឺនុយថ្មី','Create New Menu'=>'បង្កើតម៉ឺនុយថ្មី','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'ប្រសិនបើរូបរាងវេបសាយរបស់អ្នកមាននូវតំបន់វិដជិត អ្នកអាចបញ្ចូលម៉ឺនុយនៅទីនោះបាន។ សូមអាននូវ <a href="%s">ផ្ទាំងវិដជិត</a> រួចហើយបញ្ចូលនូវ &#8220;វិដជិតម៉ឺនុយរុករកមួយ&#8221; ដើម្បីធ្វើការបង្ហាញនូវម៉ឺនុយនៅលើរបារចំហៀង ឬមួយនៅជើងទំព័រ។','User cannot be added to this site.'=>'មិនអាចបន្ថែមអ្នកប្រើក្នុងវេបសាយនេះបានទេ។','Howdy ###USERNAME###,

You recently requested to have the network admin email address on
your network changed.

If this is correct, please click on the following link to change it:
###ADMIN_URL###

You can safely ignore and delete this email if you do not want to
take this action.

