ពីសមាជិកទាំងអស់នៃ ###SITENAME###
###SITEURL###','Your theme can display menus in one location. Select which menu you would like to use.'=>'រូបរាងនៃវេបសាយរបស់អ្នកអាចបង្ហាញម៉ឺនុយនៅទីតាំងចំនួនមួយ។ ជ្រើសរើសម៉ឺនុយណាដែលអ្នកចង់ប្រើ។','menu locationsView Location'=>'មើលទីតាំង','menu locationsView All Locations'=>'មើលគ្រប់ទីតាំង','It doesn&#8217;t look like your site has any menus yet. Want to build one? Click the button to start.'=>'វេបសាយរបស់អ្នកពុំទាន់មានម៉ឺនុយនៅឡើយទេ។ តើអ្នកចង់បង្កើតមួយទេ? សូមចុចលើប៊ូតុងនេះដើម្បីបង្កើត។','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'អ្នកនឹងបង្កើតម៉ឺនុយមួយ ដោយកំណត់ទីតាំងអោយវា និងបន្ថែមធាតុដូចជាតំណទៅកាន់ទំព័រ និងចំណាត់ក្រុមនានាអោយវា។ ប្រសិនបើរូបរាងវេបសាយរបស់អ្នកមានទីតាំងម៉ឺនុយច្រើន នោះអ្នកនឹងត្រូវការបង្កើតម៉ឺនុយលើសពីមួយដែរ។','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'ចុចលើ &#8220;បន្ទាប់&#8221; ដើម្បីចាប់ផ្ដើមបន្ថែមតំណទៅកាន់ម៉ឺនុយថ្មីរបស់អ្នក។','Scheduled'=>'ដាក់កំណត់ពេល','Block type names must be strings.'=>'ឈ្មោះនៃប្រភេទប្លុកត្រូវតែជាអក្សរ។','Block type names must not contain uppercase characters.'=>'ឈ្មោះនៃប្រភេទប្លុកមិនត្រូវមានផ្ទុកដោយអក្សរពុម្ភនោះទេ។','Block type names must contain a namespace prefix. Example: my-plugin/my-custom-block-type'=>'ឈ្មោះនៃប្រភេទប្លុកត្រូវតែផ្ទុកដោយ namespace prefix មួយ។ ឧទាហរណ៍: my-plugin/my-custom-block-type','Block type "%s" is already registered.'=>'ប្រភេទប្លុក "%s" បានចុះឈ្មោះរួចហើយ។','Block type "%s" is not registered.'=>'ប្រភេទប្លុក "%s" មិនទាន់បានចុះឈ្មោះនៅឡើយទេ។','Item added.'=>'ធាតុបានបញ្ចូល។','Order'=>'លំដាប់','Allow Comments'=>'អនុញ្ញាតឲ្យមានការបញ្ចេញមតិ','Permalink:'=>'តំណ:','Change Permalinks'=>'កែតំណ','Submit for Review'=>'ផ្ញើដើម្បីពិនិត្យ','Copied!'=>'បានចម្លង!','Visibility:'=>'ភាពមើលឃើញ:','Add title'=>'បញ្ចូលចំណងជើង','Visual Editor'=>'កម្មវិធីនិពន្ធឃើញផ្ទាល់','Start writing or type / to choose a block'=>'ចាប់ផ្ដើមសរសេរ ឬវាយ / ដើម្បីជ្រើសយកប្លុកមួយ','Classic Block Keyboard Shortcuts'=>'ក្ដារចុចកាត់នានានៃ Classic Block','Unable to submit this form, please try again.'=>'ពុំអាចបញ្ជូនទម្រង់នេះចេញបានទេ សូមព្យាយាមម្ដងទៀត។','Could not insert site into the database.'=>'ពុំអាចបញ្ចូលវេបសាយទៅក្នុងដេតាបេសបានទេ។','Site ID must not be empty.'=>'មិនអាចគ្មាន ID នៃវេបសាយបានទេ។','Site does not exist.'=>'មិនមានវេបសាយនេះទេ។','Could not update site in the database.'=>'ពុំអាចអាប់ដេតវេបសាយទៅក្នុងដេតាបេសបានទេ។','Could not delete site from the database.'=>'ពុំអាចលុបវេបសាយពីដេតាបេសបានទេ។','Site domain must not be empty.'=>'ទាមទារអោយបញ្ចូលដូមេននៃវេបសាយ។','Site path must not be empty.'=>'ទាមទារអោយមានផាតទៅកាន់វេបសាយ។','Site network ID must be provided.'=>'ទាមទារត្រូវតែបញ្ចូល ID នៃបណ្ដាញវេបសាយ។','[%s] Network Admin Email Change Request'=>'[%s] សំណើសុំកែប្រែអ៊ីមែលនៃអ្នកគ្រប់គ្រងបណ្ដាញ','[%s] Network Admin Email Changed'=>'[%s] អ៊ីមែលនៃអ្នកគ្រប់គ្រងបណ្ដាញបានកែប្រែ','In this case, WordPress caught an error with one of your plugins, %s.'=>'ក្នុងករណីនេះ WordPress ចាប់បានកំហុសមួយនៅក្នុងកម្មវិធីបន្ថែមណាមួយរបស់អ្នក, %s។ ','In this case, WordPress caught an error with your theme, %s.'=>'ក្នុងករណីនេះ WordPress ចាប់បានកំហុសមួយនៅក្នុងរូបរាងវេបសាយ %s.','Author'=>'អ្នក​និពន្ធ','nounComment'=>'មតិ​យោបល់','Are you sure you want to do this?'=>'តើ​អ្នក​ពិត​ជា​ចង់​ធ្វើ​បែប​នេះ​មែនទេ?','Search Results for &#8220;%s&#8221;'=>'លទ្ធផល​ស្វែងរក​ចំពោះ &#8220;%s&#8221;','Posts published on %s'=>'ប្រកាស​ដែល​ផ្សាយ​នៅ %s','Undo'=>'មិនធ្វើ','Excerpt'=>'សម្រង់','Link Categories'=>'ចំណាត់​ក្រុម​តំណ','Search Categories'=>'ស្វែងរក​ចំណាត់ក្រុម','Edit Link Category'=>'កែប្រែ​ប្រភេទ​តំណ','An unexpected error occurred. Something may be wrong with WordPress.org or this server&#8217;s configuration. If you continue to have problems, please try the <a href="https://wordpress.org/support/">support forums</a>.'=>'កំហុស​ដែល​មិន​រំពឹង​មួយ​បាន​កើត​ឡើង។ ប្រហែល​មាន​បញ្ហា​ខ្លះ​ជាមួយ WordPress.org ឬ​ជាមួយ​ការ​កំណត់​សណ្ឋាន​ម៉ាស៊ីន​បម្រើ​នេះ។ ប្រសិន​បើ​អ្នក​នៅ​តែ​បន្តែ​មាន​បញ្ហា​ទៀត សូម​សាក​ល្បង​ច