y to %s'=>'ឆ្លើយ​តប​ទៅ​កាន់ %s','Cancel reply'=>'បោះ​បង់​ការ​ឆ្លើយ​តប','Post Comment'=>'បញ្ចេញ​មតិ','Untitled'=>'គ្មាន​ចំណង​ជើង','Enter the RSS feed URL here:'=>'បញ្ចូល URL របស់ RSS feed ទីនេះ:','Give the feed a title (optional):'=>'ផ្ដល់​ឈ្មោះ feed (ស្រេច​ចិត្ត):','How many items would you like to display?'=>'តើ​អ្នក​ចង់​បង្ហាញ​របស់​ចំនួន​ប៉ុន្មាន?','Display item content?'=>'បង្ហាញ​មាតិកា​របស់​នេះ?','Display item author if available?'=>'បង្ហាញ​អ្នក​បង្កើត ប្រសិន​បើ​មាន?','Display item date?'=>'បង្ហាញ​កាល​បរិច្ឆេទ?','new WordPress Loop'=>'WordPress Loop ថ្មី','Last updated'=>'បាន​អាប់ដេត​ចុងក្រោយ','%s min'=>'%s នាទី','%s hour'=>'%s ម៉ោង','%s day'=>'%s ថ្ងៃ','%s is a protected WP option and may not be modified'=>'%s ជា​ជម្រើស WP ដែល​ត្រូវ​បាន​ការពារ ហើយ​មិន​អាច​កែ​ប្រែ​បាន​ទេ','Unable to create directory %s. Is its parent directory writable by the server?'=>'មិន​អាច​បង្កើត​ទីតាំង %s ។ តើ​ទីតាំង​មេ​របស់​វា អាច​សរសេរ​បាន​ដោយ​ម៉ាស៊ីន​បម្រើ​ទេ?','Empty filename'=>'ឈ្មោះ​ឯកសារទទេ','Could not write file %s'=>'មិន​អាច​សរសេរ​ឯកសារ %s','You are attempting to log out of %s'=>'អ្នក​មានបំណងចាកចេញពី %s','Do you really want to <a href="%s">log out</a>?'=>'តើអ្នក​ពិតជា​ចង់ <a href="%s">ចាកចេញ</a> មែន?','Please try again.'=>'សូម​ព្យាយាម​ម្ដង​ទៀត។','&laquo; Back'=>'&laquo; បក​ក្រោយ','%1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'%1$s ត្រូវ​<strong>បាន​បដិសេធ</strong> ចាប់​តាំង​ពី​ជំនាន់ %2$s! សូម​ប្រើ %3$s ជំនួស​វិញ។','%1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'%1$s ត្រូវ​<strong>បាន​បដិសេធ</strong> ចាប់​តាំង​ពី​ជំនាន់ %2$ ហើយ​គ្មាន​ជម្រើស​ផ្សេង​ទេ។','%1$s was called with an argument that is <strong>deprecated</strong> since version %2$s! %3$s'=>'%1$s ត្រូវ​បាន​ហៅ​ជាមួយ​នឹង​អាគុយម៉ង់​ដែល​<strong>ត្រូវ​បាន​ដក​ចេញ</strong>​តាំង​ពី​កំណែ %2$s! %3$s','%1$s was called with an argument that is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'%1$s ត្រូវ​បាន​ហៅ​ជាមួយ​នឹង​អាគុយម៉ង់​ដែល​