 do not want the value echoed.'=>'ប្រើ %s ជំនួស​វិញ ប្រសិនបើ​អ្នក​មិន​ចង់​ឲ្យ​បង្ហាញ​តម្លៃ​មក​ខាងក្រៅ។','Please see <a href="%s">Debugging in WordPress</a> for more information.'=>'សូម​មើល <a href="%s">ការ​រក​កំហុស​ក្នុង WordPress</a> សម្រាប់​ព័ត៌មាន​បន្ថែម។','https://codex.wordpress.org/Debugging_in_WordPress'=>'https://codex.wordpress.org/Debugging_in_WordPress','Read the <a href="%s" target="_blank">bug report</a> page. Some of the guidelines there may help you figure out what went wrong.'=>'អាន​ទំព័រ <a href="%s" target="_blank">ការ​រាយការណ៍​កំហុស</a>។ ការ​ណែនាំ​ខ្លះៗ​ទាំងនោះ​អាច​ជួយ​អ្នក​ឲ្យ​ឃើញ​ថា​អ្វី​ខ្លះ​ដែល​មាន​បញ្ហា។','https://codex.wordpress.org/Debugging_a_WordPress_Network'=>'https://codex.wordpress.org/Debugging_a_WordPress_Network','menu location(Current: %s)'=>'(បច្ចុប្បន្ន៖ %s)','<strong>ERROR</strong>: Sorry, that username is not allowed.'=>'<strong>កំហុស</strong>៖ សូមទោស, មិន​អាច​ប្រើ​ឈ្មោះ​នោះ​បាន​ទេ។','Shift-click to edit this element.'=>'Shift-click ដើម្បីកែប្រែធាតុនេះ។','Enter desktop preview mode'=>'ចូល​មើល​ជាមុន​បែប​កុំព្យូទ័រ','Enter tablet preview mode'=>'ចូល​មើល​ជាមុន​បែប​ថេប្លិត','Enter mobile preview mode'=>'ចូល​មើល​ជាមុន​បែប​ទូរសព្ទ','Display Site Title and Tagline'=>'បង្ហាញចំណងជើងវេបសាយ នឹងបន្ទាត់ស្លាក','Logo'=>'ឡូហ្គោ','Partial render must echo the content or return the content string (or array), but not both.'=>'ការ​បង្ហាញ​ដោយ​ផ្នែកៗ ត្រូវ​ផ្ដល់​មក​វិញ​នូវ​មាតិកា​ឬ​ស្ទ្រីង​នៃ​មាតិកា (ជា​អារេយ៍) ប៉ុន្តែ​មិនមែន​ម្ដង​ទាំង​ពីរ​ទេ។','%s is forbidden'=>'%s ត្រូវ​បាន​ហាម​ឃាត់','Select logo'=>'ជ្រើសរើស​ឡូហ្គោ','Change logo'=>'ប្ដូរ​ឡូហ្គោ','No logo selected'=>'មិន​បាន​ជ្រើសរើស​ឡូហ្គោ','Choose logo'=>'ជ្រើសរើស​ឡូហ្គោ','The called constructor method for %1$s in %2$s is <strong>deprecated</strong> since version %3$s! Use %4$s instead.'=>'អនុគមន៍ constructor ដែល​បាន​ហៅ​សម្រាប់ %1$s ក្នុង %2$s គឺ​<strong>លែង​ប្រើ</strong>ហើយ តាំងពី​កំណែ %3$s ម៉្លេះ! ប្រើ %4$s ជំនួស​វិញ។','Close dialog'=>'បិទ​ប្រអប់​ព័ត៌មាន','%1$s %2$s %3$s %4$s Feed'=>'%1$s %2$s %3$s %4$s Feed','Unregistering a built-in taxonomy is not allowed.'=>'មិន​អនុញ្ញាត​ឲ្យ​លុប​បំណែងប្រភេទដែលមានស្រាប់នោះទេ។','Removing %1$s manually will cause PHP warnings. Use the %2$s filter instead.'=>'ការ​លុប %1$s ដោយ​ដៃ​នឹង​បណ្ដាល​ឲ្យ​មាន​បម្រាម​ពី PHP។ សូម​ប្រើ​ការ​ច្រោះ %2$s ជំនួស​វិញ។','<a href="%1$s" aria-label="%2$s">Logged in as %3$s</a>. <a href="%4$s">Log out?</a>'=>'<a href="%1$s" aria-label="%2$s">បាន​ចូល​ជា %3$s</a>។ <a href="%4$s">ចាកចេញ?</a>','Logged in as %s. Edit your profile.'=>'បាន​ចូល​ជា %s។ កែប្រែ​ប្រវត្តិរូប​របស់​អ្នក។','html_lang_attribute'=>'km','%s is required to strip image meta.'=>'ត្រូវការ %s ដើម្បី​លុប​ទិន្នន័យ​មេតា​របស់​រូបភាព។','A structure tag is required when using custom permalinks. <a href="%s">Learn more</a>'=>'ត្រូវការ​ស្លាក​រចនាសម្ព័ន្ធ​ត្រឹមត្រូវ ដើម្បីកំណត់​តំណ​អចិន្ត្រៃយ៍​តាម​បំណង​របស់​អ្នក។ <a href="%s">សិក្សាបន្ថែម</a>','https://codex.wordpress.org/Using_Permalinks#Choosing_your_permalink_structure'=>'https://codex.wordpress.org/Using_Permalinks#Choosing_your_permalink_structure','Sorry, you are not allowed to preview drafts.'=>'សូមទោស, អ្នក​មិនមាន​សិទ្ធិ​មើល​ជាមុន​នូវ​សេចក្ដី​ព្រាង​ទេ។','Comment number declension: on or offoff'=>'off','A name is required for this term.'=>'ត្រូវការ​ឈ្មោះ​សម្រាប់​សព្ទ​មួយ​នេះ។','Edit selected menu'=>'កែប្រែមីុនុយដែលបានជ្រើស','New page title'=>'ចំណងជើងទំព័រថ្មី','New page title&hellip;'=>'ចំណងជើងទំព័រថ្មី&hellip;','Invalid changeset UUID'=>'Invalid changeset UUID','Non-existent changeset UUID.'=>'Non-existent changeset UUID.','Unauthorized. You may remove the customize_messenger_channel param to preview as frontend.'=>'ពុំមានសិទ្ធិ។ អ្នកអាចលុប customize_messenger_channel param ដើម្បីមើលផ្ទាល់ជាផ្នែកខាងមុខ។','This link is not live-previewable.'=>'តំណនេះមិនអាចមើលជាមុនដោយផ្ទាល់បានទេ។ ','This form is not live-previewable.'=>'ទម្រង់មិនអាចមើលជាមុនដោយផ្ទាល់បានទេ។','Setting does not exist or is unrecognized.'=>'ការកំណត់មិនមានអត្ថិភាព ឬក៏មិនទទួលស្គាល់។','Unauthorized to modify setting due to capability.'=>'គ្មានការអនុញ្ញាតដើម្បីកែប្រែការកំណត់ ដោយសារតែលទ្ធភាពដែលបានកំណត់។','Are you sure you want to delete this theme?'=>'តើអ្នកពិតជាចង់លុបរូបរាងវេបសាយនេះឬ?','%d themes found'=>'រកឃើញរូបរាងវេបសាយចំនួន %d','Displaying %d themes'=>'កំពុងបង្ហាញរូបរាងវេបសាយចំនួន %d','Showing details for theme: %s'=>'បង្ហាញការអធិប្បាយនៃរូបរាងវេបសាយ: %s','Search themes&hellip;'=>'ស្វែងរករូបរាងវេបសាយ&hellip;','If you add a video, the image will be used as a fallback while the video loads.'=>'ប្រសិនបើអ្នកបន្ថែមវីដេអូ នោះរូបភាពនឹងត្រូវប្រើជំនួសខណៈពេលដែលវីដេអូកំពុងធ្វើការផ្ទុក។','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends dimensions of %2$s pixels.'=>'អាប់ឡូដវីដេអូរបស់អ្នកក្នុងទម្រង់ %1$s ហើយកាត់បន្ថយទំហំហ្វាល់របស់វាដើម្បីបានលទ្ធផលល្អបំផុត។ រូបរាងនៃវេបសាយរបស់អ្នកណែនាំអោយប្រើវិមាត្រ %2$s ភិកស៊ែល។','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends a width of %2$s pixels.'=>'អាប់ឡូដវីដេអូរបស់អ្នកក្នុងទម្រង់ %1$s ហើយកាត់បន្ថយទំហំហ្វាល់របស់វាដើម្បីបានលទ្ធផលល្អបំផុត។ រូបរាងនៃវេបសាយរបស់អ្នកណែនាំអោយប្រើបណ្ដោយប្រវែង %2$s ភិកស៊ែល។','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends a height of %2$s pixels.'=>'អាប់ឡូដវីដេអូរបស់អ្នកជាទម្រង់ %1$s និងកាត់បន្ថយទំហំរបស់វាសម្រាប់លទ្ធផលល្អបំផុត។ រូបរាងនៃវេបសាយរបស់អ្នកណែនាំអោយប្រើកម្ពស់ប្រវែង %2$s ភិកស៊ែល។','Header Video'=>'ក្បាលវីដេអូ','Background PresetPreset'=>'កំណត់ជាមុន','Default PresetDefault'=>'លំនាំដើម','Fit to Screen'=>'ពេញអេក្រង់','Repeat ImageRepeat'=>'ម្តងទៀត','Custom PresetCustom'=>'ផ្ទាល់ខ្លួន','Image Position'=>'ទីតាំងរូបភាព','Image Size'=>'ទំហំរូបភាព','Original'=>'លំនាំដើម','Repeat Background Image'=>'ដាក់ផ្ទៃក្រោយនៃរូបភាពអោយចេញដដែលៗ','Scroll with Page'=>'អូសលើទំព័រ','Additional CSS'=>'CSS បន្ថែមទៀត','Learn more about CSS'=>'រៀនបន្ថែមអំពី CSS','Invalid value for background repeat.'=>'តម្លៃនៃ background repeat ពុំត្រឹមត្រូវទេ។','Invalid value for background attachment.'=>'តម្លៃនៃ background attachment ពុំត្រឹមត្រូវទេ។','Invalid value for background position X.'=>'តម្លៃនៃ background position X ពុំត្រឹមត្រូវទេ។','Invalid value for background position Y.'=>'តម្លៃនៃ background position Y ពុំត្រឹមត្រូវទេ។','Invalid value for background size.'=>'តម្លៃនៃ background size ពុំត្រឹមត្រូវទេ។','Unrecognized background setting.'=>'ការកំណត់នានានៅលើ background ពុំត្រឹមត្រូវទេ។','This video file is too large to use as a header video. Try a shorter video or optimize the compression settings and re-upload a file that is less than 8MB. Or, upload your video to YouTube and link it with the option below.'=>'ហ្វាល់វីដេអូនេះមានទំហំធំពេកក្នុងការប្រើជាវីដេអូក្បាលទំព័រ។ សូមព្យាយាមដាក់វីដេអូខ្លីៗ ឬមួយក៏ធ្វើវាឲ្យតូច រួចហើយបញ្ចូលអាប់ឡូដហ្វាល់ថ្មីនោះម្ដងទៀតដែលមានទំហំតូចជាង 8MB។ ឬក៏អាប់ឡូដវីដេអូរបស់អ្នកនៅលើ YouTube រួចដាក់តំណរបស់វាទៅក្នុងជម្រើសខាងក្រោម។','Only %1$s or %2$s files may be used for header video. Please convert your video file and try again, or, upload your video to YouTube and link it with the option below.'=>'មានតែឯកសារ %1$s ឬ %2$s ប៉ុននោះដែលអាចប្រើជាក្បាលវីដេអូ។ សូមបំលែងប្រភេទវីដេអូរបស់អ្នក រួចព្យាយាមម្ដងទៀត ឬក៏អាប់ឡូដវីដេអូរបស់អ្នកទៅក្នុង YouTube​ ហើយភ្ជាប់វាជាមួយជម្រើសពីក្រោម។','Markup is not allowed in CSS.'=>'Markup​​ មិនត្រូវបានអនុញ្ញាតអោយប្រើនៅក្នុង CSS​ ឡើយ។','Click to edit this menu.'=>'ចុចដើម្បីកែសម្រួលម៉ឺនុយនេះ។','Click to edit this widget.'=>'ចុចដើម្បីកែសម្រួលវិដជិតនេះ។','Click to edit the site title.'=>'ចុចដើម្បីកែសម្រួលចំណងជើង​វែ​ប​សាយ។','Click to edit this element.'=>'ចុចដើម្បីកែសម្រួលចំណុចនេះ។','Details for theme: %s'=>'ពិពណ៌នាអំពីរូបរាងវេបសាយ: %s','Customize theme: %s'=>'កែសម្រួលរូបរាងវេបសាយ: %s','Live preview theme: %s'=>'មើលរូបរាងវេបសាយដោយផ្ទាល់: %s','Install and preview theme: %s'=>'ដំឡើង និងមើលរូបរាងវេបសាយដោយផ្ទាល់: %s','New version available. %s'=>'កំណែថ្មីទើបចេញ។ %s','Update now'=>'អាប់ដេតតែម្តង','Change theme'=>'ប្ដូររូបរាងវេបសាយ','Filter themes'=>'ច្រោះរូបរាងវេបសាយ','You are browsing %s'=>'អ្នកកំពុងតែរុករក %s','No themes found. Try a different search, or %s.'=>'រករូបរាងវេបសាយពុំឃើញ។ ព្យាយាមការស្វែងរកមួយផ្សេងទៀត ឬ %s។','previous set of postsPrevious'=>'ពីមុន','next set of postsNext'=>'បន្ទាប់','Site title.'=>'ចំណងជើង​វែ​ប​សាយ។','A city in the same timezone as you.'=>'ទីក្រុងមួយដែលនៅក្នុងល្វែងម៉ោងដូចអ្នក។','A date format for all date strings.'=>'ទម្រង់កាលបរិច្ឆេទមួយសម្រាប់គ្រប់កាលបរិច្ឆេទទាំងអស់។','A time format for all time strings.'=>'ទម្រង់ពេលវេលសម្រាប់គ្រប់អក្សរពេលវេលាទាំងអស់។','A day number of the week that the week should start on.'=>'លេខនៃថ្ងៃក្នុងសប្ដាហ៍មួយដែលជាថ្ងៃគួរចាប់ផ្ដើមនៃសប្ដាហ៍។','WordPress locale code.'=>'លេខកូដភាសានៃ WordPress។','Convert emoticons like :-) and :-P to graphics on display.'=>'បម្លែងសញ្ញាអារម្មណ៍ដូចជា :-) និង :-P ទៅជាក្រាហ្វិកនៅលើវេបសាយ។','Default post format.'=>'ទម្រង់ប្រកាសលំនាំដើម។','Blog pages show at most.'=>'ទំព័រប្លក់បង្ហាញប្រកាសច្រើនបំផុតចំនួន','Allow link notifications from other blogs (pingbacks and trackbacks) on new articles.'=>'អនុញ្ញាតឲ្យមានការជូនដំណឹងពីប្លក់ផ្សេងទៀត (តាមរយៈ pingbacks និង trackbacks) សម្រាប់អត្ថបទក្រោយៗ។','Allow people to post comments on new articles.'=>'អនុញ្ញាតឱ្យមហាជនប្រកាសមតិយោបល់លើអត្ថបទថ្មីៗ។','The "%s" options group has been removed. Use another settings group.'=>'ក្រុមជម្រើស "%s" ត្រូវបានលុបចោល។ ប្រើក្រុមកំណត់ផ្សេងៗទៀតជំនួសវិញ។','Homepage'=>'ទំព័រដើម','Please enter a valid YouTube URL.'=>'សូមបញ្ចូល URL របស់ YouTube ដែលត្រឹមត្រូវ។','+ %s'=>'+ %s','Header Media'=>'ក្បាលនៃមេឌា','Choose video'=>'ជ្រើសយកវីដេអូ','Change video'=>'ផ្ដាស់ប្ដូរវីដេអូ','Select video'=>'ជ្រើសវិដេអូ','theme authorBy %s'=>'ដោយ​ %s','Site tagline.'=>'បាវចនាសង្ខេបនៃវេបសាយ។','Default post category.'=>'ចំណាត់​ក្រុម​ប្រកាស លំនាំដើម។ ','This address is used for admin purposes, like new user notification.'=>'អាសយដ្ឋាននេះត្រូវបានប្រើសម្រាប់គោលបំណងគ្រប់គ្រង ដូចជាការជូនដំណឹងដល់អ្នកប្រើថ្មី។','Id should start with a letter, followed only by letters, numbers, dashes, dots, colons or underscores.'=>'Id គួរចាប់ផ្តើមជាមួយអក្សរមួយបន្ដទៅដោយអក្សរផ្សេងទៀត លេខ សញ្ញាដក សញ្ញាចុច សញ្ញាចុចពីរ
 ឬក៏សញ្ញាគូសក្រោម។','Id for link anchor (TinyMCE)Id'=>'Id','Date/time'=>'Date/time','Table of Contents'=>'តារាង​មាតិកា','Insert/edit code sample'=>'បញ្ចូល/កែសម្រួល គំរូកូដ','Insert/edit media'=>'បញ្ចូល/កែសម្រួលមេឌា','%1$s is deprecated. The callback from %2$s is used instead.'=>'%1$s លែងត្រូវបានប្រើ។ ការហៅត្រលប់ពី %2$s ត្រូវបានប្រើជំនួសវិញ។','%s item'=>'%s ឯកតា','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'ស្វែងរករូបរាងនៃវេបសាយមែនទេ? អ្នកអាចស្វែងរក ឬរុករកនៅក្នុងបញ្ជីរូបរាងវេបសាយនៅលើ WordPress.org ដោយតំឡើង និងមើលរូបរាងវេបសាយនោះជាមុន បន្ទាប់មកអ្នកអាចដាក់អោយវាដំណើរការពីទីនោះតែម្ដង។','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'បណ្ដុំនៃកំណែប្រែពីមុនបានចុះផ្សាយរួចរាល់ហើយ។ សូមព្យាយាមរក្សាទុកនូវកំណែប្រែបច្ចុប្បន្នរបស់អ្នកម្ដងទៀត។','There was an authentication problem. Please reload and try again.'=>'មានកំហុសក្នុងការផ្ទៀងផ្ទាត់មួយ។ សូមផ្ទុកឡើងវិញ និងព្យាយាមម្ដងទៀត។','No changes saved yet, so there is nothing to trash.'=>'ពុំមានកំណែប្រែណាបានរក្សាទុកឡើយ ដូចនេះគ្មានអ្វីត្រូវលុបនោះទេ។','Unable to trash changes.'=>'មិនអាចលុបកំណែប្រែទាំងនេះបាន។','Changes have already been trashed.'=>'កំណែប្រែទាំងអស់បានលុបរួចរាល់ហើយ។','Changes trashed successfully.'=>'កំណែប្រែទាំងអស់ត្រូវបានលុបដោយជោគជ័យ។','Share Preview Link'=>'ចែកចាយតំណនៃការមើលផ្ទាល់','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'សូមមើលពីទិដ្ឋភាពដែលបានមកពីការកែប្រែដែលនឹងត្រូវបង្ហាញនៅលើវេបសាយរបស់អ្នក និងសូមចែកចាយនូវការមើលជាមុននេះជាមួយនឹងអ្នកឯទៀតដែលពុំអាចចូលទៅកាន់ Customizer បាន។','Preview Link'=>'មើលតំណផ្ទាល់','Copied'=>'បានកូពី','Installed themes'=>'រូបរាងវេបសាយដែលបានដំឡើង','WordPress.org themes'=>'រូបរាងវេបសាយនៅ WordPress.org','Site Icons are what you see in browser tabs, bookmark bars, and within the WordPress mobile apps. Upload one here!'=>'រូបតំណាងនៃវេបសាយរបស់អ្នក គឺជារូបដែលអ្នកឃើញនៅលើធែបនៃកម្មវិធីរុករកអ៊ីនធឺណិត របារចំណាំ និងនៅក្នុងកម្មវិធីទូរសព្ទរបស់ WordPress ។ សូមអាប់ឡូដមួយនៅទីនេះ!','Site Icons should be square and at least %s pixels.'=>'អាយខន់នៃវេបសាយគួរតែមានរាងការេ និងមានជ្រុងតូចបំផុត %s ភីកស៊ែល។','Homepage Settings'=>'ការកំណត់នៅទំព័រដើម','Your homepage displays'=>'ទំព័រដើមរបស់អ្នកបង្ហាញ','Add your own CSS code here to customize the appearance and layout of your site.'=>'បន្ថែមកូដ CSS របស់អ្នកនៅទីនេះដើម្បីកែសម្រួលរូបរាង និងប្លង់នៃវេបសាយរបស់អ្នក។','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'អ្នកអាចជ្រើសរើសនូវអ្វីដែលអ្នកចង់បង្ហាញនៅលើទំព័រដើមនៃវេបសាយរបស់អ្នក។ វាអាចជាប្រកាសនានាជាទម្រង់ពីថ្មីមកចាស់ (ប្លក់ជំនាន់មុន), ឬក៏ទំព័រដើមដែលពុំប្រែប្រួលលក្ខណៈ។ ដើម្បីកំណត់នូវទំព័រដើមដែលពុំប្រែប្រួលលក្ខណៈ ដំបូងអ្នកត្រូវបង្កើតទំព័រចំនួនពីរសិន។ ទំព័រមួយនឹងក្លាយទៅជាទំព័រដើម និងទំព័រមួយទៀតនឹងក្លាយទៅជាកន្លែងដែលប្រកាសនានារបស់អ្នកត្រូវបង្ហាញ។','Screen reader users: when in forms mode, you may need to press the escape key twice.'=>'សម្រាប់អ្នកប្រើដែលប្រើអេក្រង់អាន៖ នៅពេលដែលស្ថិតនៅក្នុងទម្រង់បំពេញបែបបទ អ្នកនឹងត្រូវចុចគ្រាប់ចុច escape ចំនួនពីរដង។','CSS code'=>'កូដ CSS','Name for the Visual editor tabVisual'=>'វីហ្សួល','Date'=>'កាលបរិច្ឆេទ','Month'=>'ខែ','Day'=>'ថ្ងៃ','Time'=>'ពេល','Hour'=>'ម៉ោង','Minute'=>'នាទី','Meridian'=>'មេរីឌាន','Timezone'=>'ល្វែងពេល','%1$s-%2$s'=>'%1$s-%2$s','Timezone is %1$s (%2$s), currently %3$s.'=>'ល្វែងពេលគឺ %1$s (%2$s) បច្ចុប្បន្នគឺ %3$s។','Timezone is %s.'=>'ល្វែងពេលគឺ %s។','Click &#8220;Add new image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'ចុចលើ &#8220;បន្ថែមរូបភាពថ្មី&#8221; ដើម្បីអាប់ឡូដឯកសាររូបភាពពីកុំព្យូទ័ររបស់អ្នក។ រូបរាងវេបសាយរបស់អ្នកដំណើរការល្អជាមួយនឹងរូបដែលត្រូវគ្នាទៅនឹងទំហំនៃវីដេអូរបស់អ្នក &#8212; អ្នកនឹងត្រូវការកាត់រូបភាពនោះ នៅពេលដែលវាបានអាប់ឡូដដើម្បីអោយវាសមជាមួយនឹងគ្នា។','Click &#8220;Add new image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'ចុចលើ &#8220;បន្ថែមរូបភាពថ្មី&#8221; ដើម្បីអាប់ឡូដឯកសាររូបភាពពីកុំព្យូទ័ររបស់អ្នក។ រូបរាងវេបសាយរបស់អ្នកដំណើរការល្អជាមួយនឹងរូបភាពដែលមានប្រវែងក្បាល %s ភីកសែល &#8212; អ្នកនឹងត្រូវការកាត់រូបភាពនោះ នៅពេលដែលអ្នកបានអាប់ឡូដដើម្បីអោយវាសមជាមួយនឹងគ្នា។','Select audio'=>'ជ្រើសយកអូឌីយ៉ូ','Change audio'=>'ប្ដូរអូឌីយ៉ូ','Choose audio'=>'ជ្រើសរើសអូឌីយ៉ូ','Choose image'=>'ជ្រើស​រូបភាព','Invalid URL.'=>'URL ពុំត្រឹមត្រូវ។','Install &amp; Preview'=>'ដំឡើង &amp; មើលផ្ទាល់','Click &#8220;Add new image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'ចុចលើ &#8220;បន្ថែមរូបភាពថ្មី&#8221; ដើម្បីអាប់ឡូដឯកសាររូបភាពពីកុំព្យូទ័ររបស់អ្នក។ រូបរាងវេបសាយរបស់អ្នកដំណើរការល្អជាមួយនឹងរូបភាពដែលមានប្រវែងបណ្ដោយ %s ភីកស៊ែល &#8212; អ្នកនឹងត្រូវការកាត់រូបភាពនោះ នៅពេលដែលវាបានអាប់ឡូដដើម្បីអោយវាសមជាមួយនឹងគ្នា។','Click &#8220;Add new image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'ចុចលើ &#8220;បន្ថែមរូបភាពថ្មី&#8221; ដើម្បីអាប់ឡូដឯកសាររូបភាពពីកុំព្យូទ័ររបស់អ្នក។ រូបរាងវេបសាយរបស់អ្នកដំណើរការល្អជាមួយនឹងរូបភាពដែលមានប្រវែងទទឹង %s ភីកស៊ែល &#8212; អ្នកនឹងត្រូវការកាត់រូបភាពនោះ នៅពេលដែលវាបានអាប់ឡូដដើម្បីអោយវាសមជាមួយនឹងគ្នា។','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you&#8217;d like.'=>'ដល់ពេលដែលត្រូវបន