###SITEURL###','Your email address has not been updated yet. Please check your inbox at %s for a confirmation email.'=>'អាសយដ្ឋានអ៊ីមែលរបស់អ្នកមិនទាន់បានអាប់ដេតនៅឡើយទេ។ សូមឆែកប្រអប់សាររបស់អ្នកនៅ %s ដើម្បីបញ្ជាក់អ៊ីមែល។','Widgets need to be registered using %s, before they can be displayed.'=>'វិដជិតទាមទារអោយចុះបញ្ជីរដោយប្រើ %s មុនពេលវាអាចធ្វើការបង្ហាញបាន។','No themes found. Try a different search.'=>'មិនមានរូបរាងវេបសាយទេ។ សូមព្យាយាមនូវការស្វែងរកមួយផ្សេងទៀត។','menu locationsWhere do you want this menu to appear?'=>'តើអ្នកចង់អោយម៉ឺនុយនេះស្ថិតនៅកន្លែងណា?','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'ខណៈពេលដែលអ្នកកំពុងមើលនូវរូបរាងថ្មីនៃវេបសាយរបស់អ្នក អ្នកក៏អាចបន្តកែសម្រួលធាតុផ្សេងៗបានផងដែរ ដូចជាវិដជិត និងម៉ឺនុយ ហើយនិងអាចរុករកនូវជម្រើសជាក់លាក់ផ្សេងៗនៃរូបរាងវេបសាយរបស់អ្នកផងដែរ។','menu locations(If you plan to use a menu <a href="%1$s" %2$s>widget%3$s</a>, skip this step.)'=>'(ប្រសិនបើអ្នកមានបំណងប្រើម៉ឺនុយ <a href="%1$s" %2$s>វិដជិត%3$s</a>, សូមរំលងដំណាក់កាលនេះ។)','https://codex.wordpress.org/WordPress_Widgets'=>'https://codex.wordpress.org/WordPress_Widgets','menu locationsHere&#8217;s where this menu appears. If you&#8217;d like to change that, pick another location.'=>'ទីនេះជាកន្លែងដែលម៉ឺនុយនេះស្ថិតនៅ។ ប្រសិនបើអ្នកចង់ប្ដូរវា សូមជ្រើសរើសទីតាំងផ្សេងទៀត។','Changeset is being edited by other user.'=>'ឆេងសិតកំពុងត្រូវបានកែសម្រួលដោយអ្នកប្រើផ្សេងទៀត។','Security check failed.'=>'បារាជ័យក្នុងការត្រួតពិនិត្យសុវត្ថិភាព។','No changeset found to take over'=>'គ្មានឆេងសិតដែលត្រូវយកមកគ្រប់គ្រងនោះទេ','Sorry, you are not allowed to take over.'=>'សុំទោស អ្នកពុំមានសិទ្ធិក្នុងការយកទៅគ្រប់គ្រងនោះទេ។','%s is already customizing this site. Do you want to take over?'=>'%s កំពុងតែកែសម្រួលវេបសាយនេះហើយ។ តើអ្នកចង់យកទៅគ្រប់គ្រងវិញទេ?','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s កំពុងតែកែសម្រួលវេបសាយនេះហើយ។ សូមរង់ចាំរហូតដល់ព