###SITEURL###','Thanks for confirming your export request.'=>'សូមអរគុណសម្រាប់ការបញ្ជាក់នូវសំណើនាំចេញរបស់អ្នក។','The site administrator has been notified. You will receive a link to download your export via email when they fulfill your request.'=>'យើងបានជូនដំណឹងទៅកាន់អភិបាលនៃវេបសាយនេះរួចហើយ។ អ្នកនឹងទទួលបានតំណមួយដើម្បីដោនឡូដនូវទិន្នន័យរបស់អ្នកតាមរយៈអ៊ីមែលនៅពេលដែលពួកគេយល់ព្រមនូវសំណើរបស់អ្នក។','Thanks for confirming your erasure request.'=>'សូមអរគុណសម្រាប់ការបញ្ជាក់នូវសំណើនៃការលុបរបស់អ្នក។','The site administrator has been notified. You will receive an email confirmation when they erase your data.'=>'យើងបានជូនដំណឹងទៅកាន់អភិបាលនៃវេបសាយនេះរួចហើយ។ អ្នកនឹងទទួលបានអ៊ីមែលបញ្ជាក់មួយពីពួកគេ នៅពេលដែលទិន្នន័យរបស់អ្នកត្រូវបានលុប។','[%1$s] Action Confirmed: %2$s'=>'[%1$s] សកម្មភាពដែលបានបញ្ជាក់: %2$s','The site is experiencing technical difficulties.'=>'វេបសាយកំពុងជួបបញ្ហាបច្ចេកទេស។','%s minute'=>'%s នាទី','%s second'=>'%s វិនាទី','localized PHP upgrade information pagehttps://wordpress.org/support/update-php/'=>'https://wordpress.org/support/update-php/','%1$s, %2$s'=>'%1$s, %2$s','post formatFormats'=>'ទ្រង់ទ្រាយ','[%s] Email Change Request'=>'[%s] សំណើសុំកែប្រែអ៊ីមែលនៃអ្នកគ្រប់គ្រង','[%s] Admin Email Changed'=>'[%s] អ៊ីមែលនៃអ្នកគ្រប់គ្រងបានកែប្រែ','No posts found.'=>'រក​មិន​ឃើញ​ប្រកាស​ទេ។','Title'=>'ចំណងជើង','Pending Review'=>'រង់ចាំ​ការ​ពិនិត្យ','Draft'=>'សេចក្តីព្រាង','Image Details'=>'លម្អិត​ពី​រូបភាព','Update gallery'=>'អាប់ដេត​វិចិត្រសាល','Apply'=>'អនុវត្ត','Revisions'=>'កំណែសម្រួល','Description'=>'ការ​អធិប្បាយ','postAdd New'=>'បន្ថែម​ថ្មី','View Post'=>'មើល​ប្រកាស','Edit Post'=>'កែប្រែ​ប្រកាស','Anonymous'=>'អនាមិក','Preview'=>'មើល​ជា​មុន','Thumbnail'=>'រូបភាព​តូច','Add Media'=>'បន្ថែម​មេឌា','Back'=>'បក​ក្រោយ','Saved.'=>'បាន​រក្សាទុក។','Left'=>'ឆ្វេង','Center'=>'កណ្ដាល','Right'=>'ស្ដាំ','Medium'=>'មធ្យម','Full Size'=>'ទំហំ​ពេញ','Alignment'=>'ការ​តម្រឹម','Edit Image'=>'កែប្រែ​រូបភាព','Media'=>'មេឌា','Image URL'=>'URL រូបភាព','Images'=>'រូបភាព','View Page'=>'មើល​ទំព័រ','Email: %s'=>'អ៊ីមែល៖ %s','Select'=>'ជ្រើស','New Page'=>'ទំព័រថ្មី','Edit Media'=>'កែប្រែ​មេឌា','New Post'=>'ប្រកាសថ្មី','Help'=>'ជំនួយ','Black'=>'ខ្មៅ','Blue'=>'ខៀវ','Brown'=>'ត្នោត','Green'=>'បៃតង','Orange'=>'ទឹក​ក្រូច','Pink'=>'ផ្កាឈូក','Purple'=>'ស្វាយ','Red'=>'ក្រហម','Silver'=>'ទឹក​ប្រាក់','White'=>'ស','Yellow'=>'លឿង','Light'=>'ភ្លឺ','<strong>ERROR</strong>: Please enter a username.'=>'<strong>កំហុស</strong>: សូមដាក់​បញ្ចូល​ឈ្មោះ​អ្នក​ប្រើ​។','There are no options for this widget.'=>'គ្មាន​ជម្រើស​សម្រាប់​ធាតុ​ក្រាហ្វិក​នេះ។','pageAdd New'=>'បន្ថែម​ថ្មី','Confirmed <span class="count">(%s)</span>'=>'បានបញ្ជាក់ <span class="count">(%s)</span>','Show Tracklist'=>'បង្ហាញ​បញ្ជី​បទ​ចម្រៀង','Pages:'=>'ទំព័រ:','Unapproved'=>'មិន​បាន​យល់​ព្រម','Duplicate comment detected; it looks as though you&#8217;ve already said that!'=>'បាន​រក​ឃើញ​មតិ​ស្ទួន។ មើល​ទៅ​អ្នក​បាន​និយាយ​អ៊ីចឹង​រួច​ម្ដង​ហើយ!','Could not update comment status'=>'មិន​អាច​អាប់ដេត​ស្ថានភាព​របស់​មតិ​បាន​ទេ','This argument has changed to an array to match the behavior of the other cron functions.'=>'អាគុយម៉ង់​នេះ​បាន​ប្ដូរ​ទៅ​ជា​សំណុំ​លំដាប់ (array) ដើម្បី​ឲ្យ​ត្រូវ​គ្នា​នឹង​លក្ខណៈ​នៃ​មុខងារ cron នានា។','Once Hourly'=>'មួយ​ម៉ោង​ម្ដង','Twice Daily'=>'មួយ​ថ្ងៃ​ពីរ​ដង','Once Daily'=>'មួយ​ថ្ងៃ​ម្ដង','Missing Attachment'=>'ខ្វះ​ឯកសារ​ភ្ជាប់','Comments for %1$s searching on %2$s'=>'មតិ​សម្រាប់ %1$s ស្វែង​រកលើ %2$s','Comments for %s'=>'មតិ​សម្រាប់ %s','Comment on %1$s by %2$s'=>'មតិ​លើ %1$s ដោយ %2$s','By: %s'=>'ដោយ: %s','Comments on: %s'=>'មតិលើ: %s','Protected Comments: Please enter your password to view comments.'=>'មតិ​ដែល​បាន​ការ​ពារ: សូម​បញ្ចូល​ពាក្យ​សម្ងាត់​របស់​អ្នក ដើម្បី​មើល​មតិ។',', '=>', ','%1$s %2$d'=>'%1$s %2$d','Gray'=>'ប្រផេះ','User has blocked requests through HTTP.'=>'អ្នក​ប្រើ​បាន​ទប់​ស្កាត់​សំណើ​តាម HTTP។','Too many redirects.'=>'មាន​ការ​ប្ដូរ​ទិស​ច្រើន​ពេក។','Playlist Settings'=>'កំណត់​បញ្ជី​ចាក់','Align'=>'តម្រឹម','Edit Gallery'=>'កែប្រែ​វិចិត្រសាល','Sorry, that username already exists!'=>'សូម​ទោស ឈ្មោះ​អ្នក​ប្រើ​នោះ មាន​រួច​ហើយ!','Sorry, that email address is already used!'=>'សូម​ទោស អាសយដ្ឋាន​អ៊ីមែល​នោះ​ត្រូវ​បាន​ប្រើ​រួច​ហើយ!','This file is too big. Files must be less than %s KB in size.'=>'ទំហំនៃហ្វាល់នេះធំពេកហើយ។ ទំហំនៃហ្វាល់ត្រូវតែតូចជាង %s KB។','[%1$s] Comment: "%2$s"'=>'[%1$s] មតិ: "%2$s"','[%1$s] Trackback: "%2$s"'=>'[%1$s] Trackback: "%2$s"','[%1$s] Pingback: "%2$s"'=>'[%1$s] Pingback: "%2$s"','Trash it: %s'=>'បោះ​វា​ចោល: %s','Delete it: %s'=>'លុប​វា: %s','Spam it: %s'=>'ធ្វើ​វា​ជា​ស្ប៉ាម: %s','Trackback excerpt: '=>'ការ​ដក​ស្រង់ trackback:','Pingback excerpt: '=>'ការ​ដក​ស្រង់ pingback:','Approve it: %s'=>'យល់​ព្រម​វា: %s','Currently %s comment is waiting for approval. Please visit the moderation panel:'=>'មាន​មតិ​ចំនួន %s កំពុង​រង់ចាំ​ការ​អនុញ្ញាត។ សូម​មើល​នៅ​ទីកន្លែង​សម្របសម្រួល:','[%1$s] Please moderate: "%2$s"'=>'[%1$s] សូម​សម្រប​ស្រួល: "%2$s"','[%s] New User Registration'=>'[%s] ការ​ចុះ​ឈ្មោះ​អ្នក​ប្រើ​ថ្មី','Protected: %s'=>'បាន​ការ​ពារ: %s','Private: %s'=>'ឯកជន: %s','There is no excerpt because this is a protected post.'=>'មិន​មាន​សេចក្ដី​ដក​ស្រង់​ទេ ព្រោះ​នេះ​ជា​ប្រកាស​ដែល​បាន​ការ​ពារ។','Next page'=>'ទំព័រ​បន្ទាប់','Previous page'=>'ទំព័រមុន','Home'=>'ទំព័រ​ដើម','%s [Autosave]'=>'%s [រក្សា​ទុក​ដោយស្វ័យ​ប្រវត្តិ]','%s [Current Revision]'=>'%s [កំណែ​សម្រួល​បច្ចុប្បន្ន]','Revision'=>'កំណែ','Published <span class="count">(%s)</span>'=>'បាន​ផ្សាយ <span class="count">(%s)</span>','Scheduled <span class="count">(%s)</span>'=>'បាន​កំណត់​ពេល <span class="count">(%s)</span>','Draft <span class="count">(%s)</span>'=>'ការ​ព្រាង <span class="count">(%s)</span>','Pending <span class="count">(%s)</span>'=>'កំពុង​រង់​ចាំ <span class="count">(%s)</span>','Private <span class="count">(%s)</span>'=>'ឯកជន <span class="count">(%s)</span>','Trash <span class="count">(%s)</span>'=>'សំរាម<span class="count">(%s)</span>','Content, title, and excerpt are empty.'=>'មាតិកា, ចំណង​ជើង, និង​សេចក្ដី​ដកស្រង់​នៅ​ទទេ។','Could not update post in the database'=>'មិន​អាច​អាប់ដេត​ប្រកាស​នៅ​ក្នុង​មូលដ្ឋានទីន្នន័យ','Could not insert post into the database'=>'មិន​អាច​បញ្ចូល​ប្រកាស​ទៅ​ក្នុង​មូលដ្ឋាន​ទិន្នន័យ','Cannot create a user with an empty login name.'=>'មិន​អាច​បង្កើត​អ្នក​ប្រើប្រាស់​ដោយ​គ្មាន​ឈ្មោះ​ចូល​ឡើយ។','AIM'=>'AIM','Yahoo IM'=>'Yahoo IM','Jabber / Google Talk'=>'Jabber / Google Talk','Invalid item ID.'=>'Invalid item ID។','Invalid parent post ID.'=>'ID នៃប្រកាសមេពុំត្រឹមត្រូវ។','The parent theme is missing. Please install the "%s" parent theme.'=>'បាត់​រូបរាង​មេ។ សូម​ដំឡើង​រូបរាង​មេ​ដែល​មាន​ឈ្មោះ "%s"។','Stylesheet is missing.'=>'ខ្វះ Stylesheet ។','<strong>ERROR</strong>: The username field is empty.'=>'<strong>កំហុស</strong>: វាលឈ្មោះអ្នកប្រើគឺទទេ។','<strong>ERROR</strong>: The password field is empty.'=>'<strong>កំហុស</strong>: វាល​ពាក្យ​សម្ងាត់​គឺ​ទទេ។','<strong>ERROR</strong>: Your account has been marked as a spammer.'=>'<strong>ERROR</strong>: គណនី​របស់​អ្នក​ត្រូវ​បាន​កត់​ចំណាំ​ថាជា​ជន​រំខាន។','Please log in again.'=>'សូម​ចូល​ម្ដង​ទៀត។','<strong>ERROR</strong>: WordPress %1$s requires MySQL %2$s or higher'=>'<strong>កំហុស</strong>: WordPress %1$s ត្រូវ​ការ MySQL %2$s ឬ​ខ្ពស់​ជាង​នេះ។','Password reset is not allowed for this user'=>'កំណត់​ពាក្យ​សម្ងាត់​ឡើង​វិញ មិន​ត្រូវ​បាន​អនុញ្ញាត​សម្រាប់​អ្នក​ប្រើ​ម្នាក់​នេះ​ទេ','Your PHP installation appears to be missing the MySQL extension which is required by WordPress.'=>'ការ​ដំឡើង PHP របស់​អ្នក ហាក់​ដូច​ជា​ខ្វះ​ផ្នែក​បន្ថែម​របស់ MySQL ដែល WordPress ត្រូវ​ការ។','WordPress database error %1$s for query %2$s made by %3$s'=>'កំហុស​មូលដ្ឋាន​ទិន្នន័យ WordPress %1$s សម្រាប់​សំណើ %2$s បាន​ធ្វើ​ដោយ %3$s','WordPress database error %1$s for query %2$s'=>'កំហុសមូលដ្ឋានទិន្ន័យ WordPress%1$s សម្រាប់​សំណើ %2$s','New trackback on your post "%s"'=>'Trackback ថ្មី​នៅ​លើ​ប្រកាស​របស់​អ្នក "%s"','New comment on your post "%s"'=>'មតិ​ថ្មី​នៅ​លើ​ប្រកាស​របស់​អ្នក "%s"','New pingback on your post "%s"'=>'Pingback ថ្មី​នៅ​លើ​ប្រកាស​របស់​អ្នក "%s"','A new trackback on the post "%s" is waiting for your approval'=>'