###SITEURL###','Reorder mode enabled'=>'បាន​បើក​ការ​តម្រៀប','Reorder mode closed'=>'បាន​បិទ​ការ​តម្រៀប','Username may not be longer than 60 characters.'=>'ឈ្មោះ​អ្នកប្រើ មិនត្រូវ​លើស​ពី 60 តួអក្សរ​ទេ។','To set your password, visit the following address:'=>'ដើម្បី​កំណត់ពាក្យសម្ងាត់ សូម​ចូល​តាម​អាសយដ្ឋាននេះ៖','WordPress database error:'=>'មូលដ្ឋាន​ទិន្នន័យ WordPress មាន​បញ្ហា៖','As a browser icon'=>'ជា​រូប​តំណាង​ក្នុង​កម្មវិធី​អ៊ីនធឺណិត','Preview as a browser icon'=>'មើល​សាក​ជា​រូបតំណាង​ក្នុង​កម្មវិធី​អ៊ីនធឺណិត','As an app icon'=>'ជា​រូប​តំណាង​កម្មវិធី','Preview as an app icon'=>'មើល​ជាមុន​ជា​រូប​តំណាង​កម្មវិធី','Continue reading %s'=>'បន្ត​ការ​អាន %s','Press return or enter to open this section'=>'ចុច Return ឬ Enter ដើម្បី​បើក​ផ្នែក​នេះ','Reorder widgets'=>'តម្រៀប​វិដជិត','%s <span class="screen-reader-text">Comment</span>'=>'%s <span class="screen-reader-text">មតិ</span>','Open sharing dialog'=>'បើក​ប្រអប់​ចែករំលែក','WordPress Embed'=>'WordPress Embed','HTML Embed'=>'បង្កប់ HTML','Copy and paste this URL into your WordPress site to embed'=>'ចម្លង​និង​បិទភ្ជាប់ URL នេះ​ក្នុង​វេបសាយ WordPress របស់​អ្នក ដើម្បី​បង្កប់','Copy and paste this code into your site to embed'=>'ចម្លង​និង​បិទភ្ជាប់​កូដ​នេះ​ក្នុង​វេបសាយ​របស់​អ្នក​ដើម្បី​បង្កប់​វា','Close sharing dialog'=>'បិទ​ប្រអប់​ចែករំលែក','playlist item title&#8220;%s&#8221;'=>'&#8220;%s&#8221;','Post Archives'=>'បណ្ណសារ​ប្រកាស','Page Archives'=>'បណ្ណសារ​ទំព័រ','Filter posts list'=>'ច្រោះ​បញ្ជី​ប្រកាស','Filter pages list'=>'ច្រោះ​បញ្ជី​ទំព័រ','Posts list navigation'=>'ការ​រក​មើល​ក្នុង​បញ្ជី​ប្រកាស','Pages list navigation'=>'ការ​រក​មើល​ក្នុង​បញ្ជី​ទំព័រ','Posts list'=>'បញ្ជី​ប្រកាស','Pages list'=>'បញ្ជី​ទំព័រ','%1$s (since %2$s; use %3$s instead)'=>'%1$s (ចាប់តាំងពី %2$s; ប្រើ %3$s ជំនួស) ','%1$s (since %2$s; no alternative available)'=>'%1$s (តាំងពី %2$s; គ្មាន​ការ​ជំនួស​ផ្សេង​ទេ)','%1$s (since %2$s; %3$s)'=>'%1$s (តាំងពី %2$s; %3$s)','Cookie nonce is invalid'=>'ខូឃី Nonce មិន​ត្រឹមត្រូវ​ទេ','<strong>ERROR</strong>: Invalid username.'=>'<strong>កំហុស</strong>៖ ខុស​ឈ្មោះ​អ្នក​ប្រើ។','<strong>ERROR</strong>: The password you entered for the username %s is incorrect.'=>'<strong>កំហុស</strong>៖ ពាក្យ​សម្ងាត់​ដែល​អ្នក​បាន​បញ្ចូល​សម្រាប់​ឈ្មោះ %s គឺ​មិន​ត្រឹមត្រូវ​ទេ។','Nicename may not be longer than 50 characters.'=>'ឈ្មោះ​ស្អាត (Nicename) មិន​អាច​លើស​ពី 50 តួអក្សរ​នោះ​ទេ។','Could not save password reset key to database.'=>'មិន​អាច​រក្សាទុក​ក្នុង​មូលដ្ឋាន​ទិន្នន័យ​នូវ សោ​សម្រាប់​ការ​កំណត់​ពាក្យ​សម្ងាត់​ឡើង​វិញ។','Can&#8217;t select database'=>'មិនអាច​ជ្រើសរើស​មូលដ្ឋាន​ទិន្នន័យ','We were able to connect to the database server (which means your username and password is okay) but not able to select the %s database.'=>'ពួកយើង​អាច​ភ្ជាប់​ទៅ​ម៉ាស៊ីនបម្រើ​មូលដ្ឋាន​ទិន្នន័យ​បាន (មាន​ន័យ​ថា​ឈ្មោះ​អ្នកប្រើ​និង​ពាក្យ​សម្ងាត់ គ្មាន​បញ្ហា​ទេ) ប៉ុន្តែ​មិន​អាច​ជ្រើសរើស​មូលដ្ឋាន​ទិន្នន័យ %s បាន​នោះ​ទេ។','Are you sure it exists?'=>'តើ​អ្នក​ប្រាកដ​ថា​វា​មាន​មែន​ទេ?','Does the user %1$s have permission to use the %2$s database?'=>'តើ​អ្នក​ប្រើ​ឈ្មោះ %1$s មាន​សិទ្ធិ​ប្រើប្រាស់​មូលដ្ឋាន​ទិន្នន័យ %2$s ដែរ​ឬ​ទេ?','On some systems the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?'=>'នៅ​លើ​ប្រព័ន្ធ​ខ្លះ ឈ្មោះ​មូលដ្ឋាន​ទិន្នន័យ​គឺ​មាន​បុព្វបទ​ជា​ឈ្មោះ​អ្នក​ប្រើ​របស់​អ្នក ដូច្នេះ​វា​អាច​មាន​សណ្ឋាន​ដូច <code>username_%1$s</code>។ តើ​នោះ​អាច​ជា​បញ្ហា​ដែរ​ឬ​ទេ?','If you don&#8217;t know how to set up a database you should <strong>contact your host</strong>. If all else fails you may find help at the <a href="%s">WordPress Support Forums</a>.'=>'បើ​អ្នក​មិន​ដឹង​អំពី​ការ​រៀបចំ​ដំឡើង​មូលដ្ឋាន​ទិន្នន័យ​ទេ អ្នក​គួរតែ​ទាក់ទង <strong>អ្នក​គ្រប់គ្រង​ហូស្ទីង</strong> របស់​អ្នក។ បើ​នៅ​តែ​មិន​បាន​សម្រេច​ទៀត អ្នក​អាច​រក​ជំនួយ​បាន​នៅ <a href="%s">វេទិកា​ទំនុកបម្រុង WordPress Support</a>។','This either means that the username and password information in your %1$s file is incorrect or we can&#8217;t contact the database server at %2$s. This could mean your host&#8217;s database server is down.'=>'នេះ​មាន​ន័យ​ថា​ឈ្មោះ​អ្នកប្រើប្រាស់​និង​ពាក្យ​សម្ងាត់​នៅ​ក្នុង​ឯកសារ %1$s របស់​អ្នក គឺ​មិន​ត្រឹមត្រូវ​ទេ ឬ​ក៏​ពួកយើង​មិន​អាច​ភ្ជាប់​ទំនាក់ទំនង​ទៅ​ម៉ាស៊ីន​មូលដ្ឋាន​ទិន្នន័យ​របស់​អ្នក​នៅ %2$s។ ការណ៍​នេះ​អាច​មាន​ន័យ​ថា​ម៉ាស៊ីន​មូលដ្ឋាន​ទិន្នន័យ​របស់​អ្នក មិនមាន​ដំណើរការ​ទេ។','Are you sure you have the correct username and password?'=>'តើ​អ្នក​ពិត​ជា​មាន​ឈ្មោះ​អ្នក​ប្រើ​និង​ពាក្យ​សម្ងាត់​ដែល​ត្រឹមត្រូវ​មែន​ទេ?','Are you sure that you have typed the correct hostname?'=>'តើ​អ្នក​ពិតជា​បាន​បញ្ចូល​ឈ្មោះ​ហូស្ទ​ត្រឹមត្រូវ​ហើយ​មែន​ឬ?','Are you sure that the database server is running?'=>'តើ​អ្នក​ប្រាកដ​ថា​ម៉ាស៊ីនបម្រើ​មូលដ្ឋាន​ទិន្នន័យ​មាន​ដំណើរការ​ឬ​ទេ?','If you&#8217;re unsure what these terms mean you should probably contact your host. If you still need help you can always visit the <a href="%s">WordPress Support Forums</a>.'=>'ប្រសិនបើអ្នកមិនប្រាកដថាអ្វីជាTerms អ្នកគួរតែទាក់ទង ទៅម៉ាស៊ីនបង្ហោះរបស់អ្នក។ ប្រសិនអ្នកត្រូវការជំនួយ អ្នកនូវតែអាចចូលមើល <a href="%s">"វេទិកាជំនួយគាំទ្ររបស់ WordPress"</a>។','Error reconnecting to the database'=>'មាន​បញ្ហា​ក្នុង​ការ​តភ្ជាប់​ឡើង​វិញ​ទៅ​មូលដ្ឋាន​ទិន្នន័យ','This means that we lost contact with the database server at %s. This could mean your host&#8217;s database server is down.'=>'នេះ​អាច​មាន​ន័យ​ថា ពួកយើង​បាត់បង់​ទំនាក់ទំនង​ជាមួយ​ម៉ាស៊ីន​មូលដ្ឋាន​ទិន្នន័យ​នៅ %s។ នេះ​អាច​មាន​ន័យ​ថា​ម៉ាស៊ីន​មូលដ្ឋាន​ទិន្នន័យ​របស់​អ្នក មិនមាន​ដំណើរការ​ទេ។','Are you sure that the database server is not under particularly heavy load?'=>'តើ​អ្នក​ប្រាកដ​ដែរ​ឬ​ទេ​ថា ម៉ាស៊ីន​មូលដ្ឋាន​ទិន្នន័យ​របស់​អ្នក​មិន​កំពុង​ធ្វើការ​ហួស​កម្រិត?','Sharing options'=>'ជម្រើស​ចែករំលែក','Use %s instead.'=>'ប្រើ %s ជំនួស​វិញ។','<strong>ERROR</strong>: %1$s in %2$s can only contain numbers, letters, and underscores.'=>'<strong>កំហុស</strong>៖ %1$s ក្នុង %2$s អាច​ដាក់​បានតែ​លេខ, អក្សរ, និង​បន្ទាត់​គូសក្រោម ( _ ) ប៉ុណ្ណោះ។','Invalid object type'=>'ប្រភេទ​វត្ថុ​មិន​ត្រឹមត្រូវ','Template is missing. Standalone themes need to have a %1$s template file. <a href="%2$s">Child themes</a> need to have a Template header in the %3$s stylesheet.'=>'បាត់​ពុម្ព​គំរូ។ រូបរាង​ដែល​នៅ​តែ​ឯង ត្រូវ​មាន​ពុម្ព​គំរូ %1$s មួយ។ <a href="%2$s">កូន​រូបរាង</a> ត្រូវ​មាន​ក្បាល​ពុម្ពគំរូ នៅ​ក្នុង​ស្ទ៉ែលស៊ីត %3$s។','comment statusApproved'=>'បាន​អនុញ្ញាត','comment statusSpam'=>'ស្ប៉ាម','comment statusTrash'=>'សំរាម','<strong>ERROR</strong>: your name is too long.'=>'<strong>កំហុស</strong>៖ ឈ្មោះ​របស់​អ្នក​វែង​ពេក​ហើយ។','<strong>ERROR</strong>: your email address is too long.'=>'<strong>កំហុស</strong>៖ អាសយដ្ឋាន​អ៊ីមែល​របស់​អ្នក​វែង​ពេក​ហើយ។','<strong>ERROR</strong>: your url is too long.'=>'<strong>កំហុស</strong>៖ url របស់​អ្នក​វែង​ពេក​ហើយ។','<strong>ERROR</strong>: your comment is too long.'=>'<strong>កំហុស</strong>៖ មតិ​របស់​អ្នក​វែង​ពេក​ហើយ។','<strong>ERROR</strong>: Invalid username, email address or incorrect password.'=>'<strong>កំហុស</strong>៖ ឈ្មោះ​អ្នកប្រើ​មិន​ត្រឹមត្រូវ, អាសយដ្ឋាន​អ៊ីមែល​មិន​ត្រឹមត្រូវ, ឬ​ខុស​ពាក្យ​សម្ងាត់។','post password formEnter'=>'វាយ​បញ្ចូល','post statusPublished'=>'បានផ្សាយ','post statusScheduled'=>'បាន​កំណត់​ពេល','post statusDraft'=>'សេចក្ដី​ព្រាង','post statusPending'=>'កំពុង​រង់ចាំ','post statusPrivate'=>'ឯកជន','post statusTrash'=>'សំរាម','Unregistering a built-in post type is not allowed'=>'មិន​អនុញ្ញាត​ចំពោះ​ការ​ដក​ប្រភេទ​ប្រកាស​របស់​ប្រព័ន្ធ​ទេ','Routes must be namespaced with plugin or theme name and version.'=>'Route ត្រូវតែ​មាន namespace ជា​ឈ្មោះ​និង​កំណែ​របស់​កម្មវិធី​បន្ថែម​ឬ​រូបរាង។','Route must be specified.'=>'ត្រូវតែ​បញ្ជាក់ Route។','<strong>ERROR</strong>: The email field is empty.'=>'<strong>កំហុស</strong>៖ វាល​បំពេញ​អ៊ីមែល​នៅ​ទទេ។','<strong>ERROR</strong>: Invalid email address.'=>'<strong>កំហុស</strong>៖ អាសយដ្ឋាន​អ៊ីមែល​មិន​ត្រឹមត្រូវ។','<strong>ERROR</strong>: The password you entered for the email address %s is incorrect.'=>'<strong>កំហុស</strong>៖ ពាក្យ​សម្ងាត់​ដែល​អ្នក​បាន​បញ្ចូល​សម្រាប់​អាសយដ្ឋាន​អ៊ីមែល %s គឺ​មិន​ត្រឹមត្រូវ​ទេ។','user dropdown%1$s (%2$s)'=>'%1$s (%2$s)','The constant %1$s <strong>is deprecated</strong>. Use the boolean constant %2$s in %3$s to enable a subdomain configuration. Use %4$s to check whether a subdomain configuration is enabled.'=>'ថេរ %1$s គឺ​<strong>លែង​ប្រើ</strong>​ហើយ។ ប្រើ​ថេរ​ប៊ូលាន (boolean constant) %2$s ក្នុង %3$s ដើម្បី​បើក​ការ​កំណត់​រចនាសម្ព័ន្ធ​ដូមែន​រង។ ប្រើ %4$s ដើម្បី​មើល​ថា​តើ​ការ​កំណត់​រចនាសម្ព័ន្ធ​ដូមែន​រង បានបើក​ហើយ​ឬ​នៅ។','&#8220;%1$s&#8221; &#8212; %2$s'=>'&#8220;%1$s&#8221; &#8212; %2$s','No media files found.'=>'គ្មានឯកសាមេឌាទេ។','Do not pass %1$s tags to %2$s.'=>'កុំ​ផ្ដល់​ស្លាក %1$s ទៅ %2$s។','Image crop area preview. Requires mouse interaction.'=>'មើល​ជាមុន​នូវ​ដែន​ដែល​ត្រូវ​ច្រឹប​រូបភាព។ ត្រូវការ​ការ​បញ្ជា​ពី​ម៉ៅស៍។','Password changed for user: %s'=>'បាន​ប្ដូរ​ពាក្យ​សម្ងាត់​សម្រាប់​អ្នកប្រើ៖ %s','[%s] Password Changed'=>'[%s] 	លេខសំងាត់ត្រូវបានប្ដូរ','Unable to retrieve the error message from MySQL'=>'មិន​អាច​ទៅយក​សារ​កំហុស​ពី MySQL បាន​ទេ','Tan'=>'ពណ៌ដាំដែង','Dark'=>'ងងឹត','Fixed Layout'=>'ប្លង់ថេរ','Fluid Layout'=>'ប្លង់​រីករួម​ជានិច្ច','Responsive Layout'=>'ប្លង់​ប្រែប្រួល​តាម​បរិបទ','Photoblogging'=>'ប្លក់​អំពី​រូបភាព','Seasonal'=>'តាម​រដូវកាល','Inexistent terms.'=>'មិនមាន​សព្ទ។','PHP\'s XML extension is not available. Please contact your hosting provider to enable PHP\'s XML extension.'=>'PHP\'s XML extension មិនបានបើក។ សូមទាក់ទងទៅអ្នកផ្តល់សេវាបង្ហោះវេបសាយដើម្បីបើកវា។','Number of widgets found: %d'=>'ចំនួនវិដជិតដែលបានរកឃើញ: %d','No widgets found.'=>'រកវិដជិតមិនឃើញទេ។','Search media items...'=>'ស្វែងរកធាតុផ្សេងៗនៃមេឌា...','%1$s %2$s, %3$s ago (%4$s)'=>'%1$s %2$s, %3$s ago (%4$s)','Attachment Attributes'=>'លក្ខណៈនៃឯកសារភ្ជាប់','Custom CSS'=>'CSS ផ្ទាល់ខ្លួន','post type general nameChangesets'=>'Changesets','post type singular nameChangeset'=>'Changeset','admin menuChangesets'=>'Changesets','add new on admin barChangeset'=>'Changeset','Customize ChangesetAdd New'=>'បន្ថែមថ្មី ','Add New Changeset'=>'បន្ថែម Changeset','New Changeset'=>'Changeset ថ្មី','Edit Changeset'=>'កែសម្រួល Changeset','View Changeset'=>'ពិនិត្យ Changeset','All Changesets'=>'Changesets ទាំងអស់','Search Changesets'=>'ស្វែងរក Changesets','No changesets found.'=>'រកមិនឃើញ changesets ទេ។','No changesets found in Trash.'=>'រក changesets មិនឃើញនៅក្នុងធុងសំរាមទេ។','View Posts'=>'ពិនិត្យប្រកាសនានា','View Pages'=>'ពិនិត្យទំព័រនានា','Post Attributes'=>'លក្ខណៈនានានៃប្រកាស','Page Attributes'=>'លក្ខណៈនានានៃទំព័រ','Sorry, you are not allowed to upload media on this site.'=>'សូមទោស អ្នកពុំមានសិទ្ធិក្នុងការអាប់ឡូដមេឌានៅលើវេបសាយនេះទេ។','Sorry, you are not allowed to upload media to this post.'=>'សូមទោស អ្នកពុំមានសិទ្ធិក្នុងការអាប់ឡូដមេឌាទៅក្នុងប្រកាសនេះបានទេ។','Invalid parent type.'=>'ប្រភពប្រភេទមិនត្រឺមត្រូវ។','Alternative text to display when attachment is not displayed.'=>'អក្សរជំនួសដើម្បីបង្ហាញនៅពេលឯកសារភ្ជាប់មិនបានបង្ហាញ។','Details about the media file, specific to its type.'=>'លម្អិតអំពីហ្វាល់មេឌា ដែលជាក់លាក់នៅក្នុងប្រភេទរបស់ខ្លួន។','The ID for the associated post of the attachment.'=>'ID នៃប្រកាសដែលទាក់ទងសម្រាប់ឯកសារភ្ជាប់នេះ។','No data supplied.'=>'គ្មានទិន្នន័យផ្តល់ឱ្យ។','No Content-Type supplied.'=>'ពុំមានបោះ Content-Type មកទេ។','No Content-Disposition supplied.'=>'ពុំមានបោះ Content-Disposition មកទេ។','Invalid Content-Disposition supplied. Content-Disposition needs to be formatted as `attachment; filename="image.png"` or similar.'=>'Invalid Content-Disposition supplied. Content-Disposition needs to be formatted as `attachment; filename="image.png"` or similar.','Content hash did not match expected.'=>'Content hash did not match expected.','Could not open file handle.'=>'Could not open file handle.','Limit result set to attachments of a particular media type.'=>'កំណាត់ result set ទៅកាន់ឯកសារភ្ជាប់នៃប្រភេទរបស់មេឌាជាក់លាក់មួយ។','Limit result set to attachments of a particular MIME type.'=>'កំណត់ result set ជាឯកសារភ្ជាប់នៃប្រភេទ MIME ជាក់លាក់មួយ។','An alphanumeric identifier for the user.'=>'An alphanumeric identifier for the user.','The %s property has an invalid stored value, and cannot be updated to null.'=>'លក្ខណៈសម្បត្តិនៃ %s មានតម្លៃផ្ទុកមួយដែលពុំត្រឹមត្រូវ ហើយក៏ពុំអាចកែអោយទៅជា null បានដែរ។','Number of published posts for the term.'=>'ចំនួននៃប្រកាសដែលបានបោះពុម្ភសម្រាប់សព្ទមួយនេះ។','HTML description of the term.'=>'ពណ៌នា HTML នៃសព្ទ។','An alphanumeric identifier for the term unique to its type.'=>'An alphanumeric identifier for the term unique to its type.','Type attribution for the term.'=>'ប្រភេទលក្ខណៈសម្បត្តិរបស់សព្ទ។','Sort collection by term attribute.'=>'តម្រៀបបណ្ដុំដោយប្រើលក្ខណៈនៃសព្ទ។','Whether to hide terms not assigned to any posts.'=>'ថាតើត្រូវលាក់សព្ទដែលមិនបានភ្ជាប់ទៅកាន់ប្រកាសណាមួយ។','Limit result set to terms assigned to a specific parent.'=>'កំណត់បណ្ដុំលទ្ធផលជាសព្ទ ដែលបានភ្ជាប់ទៅកាន់មេមួយ។','Limit result set to terms assigned to a specific post.'=>'កំណត់បណ្ដុំលទ្ធផលជាសព្ទ ដែលបានភ្ជាប់ទៅប្រកាសជាក់លាក់មួយ។','The email address for the user.'=>'អាសយដ្ឋានអ៊ីម៉ែលសម្រាប់អ្នកប្រើប្រាស់។','Registration date for the user.'=>'ការចុះបញ្ជីកាលបរិច្ឆេទសម្រាប់អ្នកប្រើ។','Password for the user (never included).'=>'ពាក្យសម្ងាត់សំរាប់អ្នកប្រើប្រាស់ ​(មិនដែលត្រូវបានរួមបញ្ចូល)។','All capabilities assigned to the user.'=>'លទ្ធភាពទាំងអស់ត្រូវបានកំណត់ទៅអោយអ្នកប្រើប្រាស់។','Any extra capabilities assigned to the user.'=>'លទ្ធភាពបន្ថែមផ្សេងៗទៀតត្រូវបានកំណត់អោយអ្នកប្រើប្រាស់។','Limit result set to users matching at least one specific role provided. Accepts csv list or single role.'=>'កំណត់បណ្ដុំលទ្ធផលជាអ្នកប្រើប្រាស់ដែលត្រូវគ្នានឹងតួនាទីយ៉ាងតិចមួយដែលបានផ្ដល់ឲ្យ។ បញ្ជី CSV ឬតួនាទីត្រឹមមួយក៏អាចទទួលយកបាន។','%1$s is not of type %2$s.'=>'%1$s មិនមែនជាប្រភេទនៃ%2$s។','%s is not a valid IP address.'=>'%s គឺមិនមានអាស័យដ្ឋានIPត្រឹមត្រូវទេ។','%1$s must be between %2$d (exclusive) and %3$d (exclusive)'=>'%1$s ត្រូវតែនៅចន្លោះ %2$d (ទាំងស្រុង) ហើយ %3$d (បញ្ចូលគ្នា)','%1$s must be between %2$d (inclusive) and %3$d (exclusive)'=>'%1$s ត្រូវតែនៅចន្លោះ %2$d (បញ្ចូលគ្នា) ហើយ %3$d (ទាំងស្រុង)','%1$s must be between %2$d (exclusive) and %3$d (inclusive)'=>'%1$s ត្រូវតែនៅចន្លោះ %2$d (មិនយក) និង %3$d (យក)','%1$s must be between %2$d (inclusive) and %3$d (inclusive)'=>'%1$s ត្រូវតែនៅចន្លោះ %2$d (បញ្ចូលគ្នា) ហើយ %3$d (បញ្ចូលគ្នា)','URL of the term.'=>'អាស័យ​ដ្ឋាន​​នៃសព្ទ។ ','Terms do not support trashing. Set \'%s\' to delete.'=>'សព្ទ មិនគាំទ្រនូវការលុបចោលនោះទេ។ កំណត់ \'%s\' ដើម្បីលុប។','Caption for the attachment, as it exists in the database.'=>'ចំណងជើងរបស់ឯកសារ​ភ្ជាប់ ដូចដែលមានស្រាប់ក្នុងមូលរដ្ឋានទិន្នន័យ។','HTML caption for the attachment, transformed for display.'=>'ចំណងជើងជា HTML របស់ឯកសារ​ភ្ជាប់។ វានឹងបម្លែងសម្រាប់បង្ហាញលើវេបសាយ។','Description for the object, as it exists in the database.'=>'បរិយាយលើកម្មវត្ថុនេះ ដូចដែលមានស្រាប់នៅក្នុងមូលដ្ឋានទិន្នន័យ។','HTML description for the object, transformed for display.'=>'បរិយាយ HTML សម្រាប់កម្មវត្ថុ។ វានឹងបម្លែងសម្រាប់បង្ហាញលើវេបសាយ។','default site languageSite Default'=>'លំនាំដើមនៃវេបសាយ','Document Preview'=>'ពិនិត្យឯកសារ','Passwords cannot contain the "\\" character.'=>'លេខសម្ងាត់មិនអាចមានតួអក្សរបែបនេះទេ "\\"។','Sorry, you are not allowed to create new terms.'=>'សូមទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យបង្កើតសព្ទថ្មីទេ។','Invalid page template.'=>'ពុម្ពទំព័រមិនត្រឹមត្រូវ។','The attachment caption.'=>'ចំណងជើងនៃឯកសារភ្ជាប់។','The attachment description.'=>'សេចក្ដីលំអិតនៃឯកសារភ្ជាប់។ ','Attachment type.'=>'ប្រភេទនៃឯកសារភ្ជាប់។ ','The attachment MIME type.'=>'ភ្ជាប់ឯកសារប្រភេទ MIME។ ','URL to the original attachment file.'=>'អាស័យដ្ឋាន ទៅកាន់ឯកសារច្បាប់ដើមដែលបានភ្ជាប់។ ','Term does not exist.'=>'សព្ទនេះមិនមាននោះទេ។ ','The term cannot be deleted.'=>'សព្ទ​ដែល​មិន​អាច​លុប​បាន។ ','HTML title for the term.'=>'ចំណងជើង​HTML សម្រាប់​សព្ទ។ ','The parent term ID.'=>'ID នៃសព្ទមេ។','Login name for the user.'=>'ឈ្មោះចូលដំណើរការ សម្រាប់អ្នកប្រើប្រាស់។ ','Display name for the user.'=>'បង្ហាញ​ឈ្មោះ​សម្រាប់​អ្នក​ប្រេីប្រាស់។ ','First name for the user.'=>'នាមខ្លួន​ សម្រាប់អ្នកប្រើប្រាស់។ ','Last name for the user.'=>'គោត្តនាម​ សម្រាប់​អ្នក​​​ប្រេីប្រាស់។ ','URL of the user.'=>'អាស័យ​ដ្ឋាន​នៃ ​​អ្នកប្រើប្រាស់។ ','Description of the user.'=>'សេចក្តី​លម្អិត​នៃ ​​អ្នកប្រើប្រាស់។ ','Author URL of the user.'=>'អាស័យដ្ឋានអ្នកនិពន្ធ នៃអ្នកប្រើប្រាស់។ ','Locale for the user.'=>'ទីតាំង​តំបន់ សម្រាប់​អ្នក​ប្រើប្រាស់។ ','The nickname for the user.'=>'ឈ្មោះ​ហៅ​ក្រៅ ​សម្រាប់​​អ្នកប្រេីប្រាស់។ ','Roles assigned to the user.'=>'កំណត់សិទ្ធដែលផ្ដល់ទៅឲ្យ សម្រាប់អ្នកប្រើប្រាស់។ ','Avatar URLs for the user.'=>'អាស័យ​ដ្ឋាន​អវតារ​ សម្រាប់​អ្នក​​ប្រេីប្រាស់។ ','Unique identifier for the term.'=>'គ្រឿងសម្គាល់តែមួយគត់សម្រាប់សព្ទនេះ។','Required to be true, as terms do not support trashing.'=>'ទាមទារអោយដាក់ទៅ true ដោយសារសព្ទមិនអាចលុបបាន។','Your theme has 1 other widget area, but this particular page doesn&#8217;t display it.'=>'រូបរាងវេបសាយរបស់អ្នកមានតំបន់វិដជិតមួយផ្សេងទៀត ប៉ុន្តែទំព័រពិសេសនេះមិនបានបង្ហាញទេ។','Your theme has %s other widget area, but this particular page doesn&#8217;t display it.'=>'រូបរាងវេបសាយរបស់អ្នកមានតំបន់វិដជិត​%sផ្សេងទៀត ប៉ុន្តែទំព័រជាក់លាក់នេះមិនត្រូវបានបង្ហាញទេ។','Your theme has 1 widget area, but this particular page doesn&#8217;t display it.'=>'រូបរាងវេបសាយរបស់អ្នកមានតំបន់វិដជិត​១ ប៉ុន្តែទំព័រជាក់លាក់នេះមិនត្រូវបានបង្ហាញទេ។','Your theme has %s widget area, but this particular page doesn&#8217;t display it.'=>'រូបរាងវេបសាយរបស់អ្នកមានតំបន់វិដជិត%s ប៉ុន្តែទំព័រជាក់លាក់នេះមិនត្រូវបានបង្ហាញទេ។','You can navigate to other pages on your site while using the Customizer to view and edit the widgets displayed on those pages.'=>'អ្នកអាចស្វែងរកទំព័រផ្សេងទៀតនៅលើវេបសាយរបស់អ្នកដោយប្រើប្រាស់ Customizer ដើម្បីមើលនិងកែសម្រួលវិដជិតផ្សេងៗដែលបានបង្ហាញនៅលើទំព័រទាំងនោះ។','Sorry, comments are not allowed for this item.'=>'សុំទោស មតិយោបល់មិនត្រូវបានអនុញ្ញាតសម្រាប់ប្រកាសនេះទេ។','Suggested image dimensions: %1$s by %2$s pixels.'=>'វិមាត្ររូបភាពដែលបានស្នើ: %1$s​ ដោយ %2$s ភីកសែល។','You are about to permanently delete this item from your site.
This action cannot be undone.
