Invalid post ID.'=>'អត្តលេខ​ប្រកាស​មិន​ត្រឹម​ត្រូវ។','Comment author name and email are required.'=>'ត្រូវ​ការ​ឈ្មោះ និង​អ៊ីមែល​អ្នក​បញ្ចេញ​មតិ។','A valid email address is required.'=>'ត្រូវ​ការ​អាសយដ្ឋាន​អ៊ីមែល​ត្រឹម​ត្រូវ​មួយ។','Sorry, you are not allowed to update options.'=>'សូមទោស, អ្នក​មិនមាន​សិទ្ធិ​អាប់ដេត​ជម្រើស​ទេ។','Either there are no posts, or something went wrong.'=>'មិន​មាន​ទាំង​ប្រកាស ឬ​កំហុស​អ្វី​ទេ។','Sorry, you are not allowed to publish this post.'=>'សូមទោស, អ្នក​មិនមាន​សិទ្ធិ​ផ្សាយ​ប្រកាស​នេះ​ទេ។','Sorry, no such post.'=>'សូម​ទោស, មិន​មាន​ប្រកាស​ទេ។','Sorry, you are not allowed to publish posts in this post type.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតអោយប្រកាសនៅក្នុងប្រភេទប្រកាសនេះឡើយ។','Invalid post type.'=>'ខុស​ប្រភេទ​ប្រកាស។','Sorry, you are not allowed to update posts as this user.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតអោយកែសម្រួលប្រកាសដូចអ្នកប្រើនេះឡើយ។','Sorry, you are not allowed to change the post author as this user.'=>'សូមទោស, អ្នក​មិនមាន​សិទ្ធិ​ប្ដូរ​អ្នក​បង្កើត​ប្រកាស ដូច​អ្នក​ប្រើប្រាស់​ម្នាក់​នេះ​ទេ។','Sorry, you are not allowed to change the page author as this user.'=>'សូមទោស, អ្នក​មិនមាន​សិទ្ធិ​ផ្លាស់ប្ដូរ​ឈ្មោះ​អ្នក​បង្កើត​ទំព័រ ដូច​អ្នក​ប្រើប្រាស់​ម្នាក់​នេះ​ទេ។','Could not write file %1$s (%2$s).'=>'មិន​អាច​សរសេរ​ឯកសារ %1$s (%2$s)។','Is there no link to us?'=>'មិន​មាន​តំណ​ភ្ជាប់​មក​កាន់​យើង​ទេ?','The specified target URL cannot be used as a target. It either doesn&#8217;t exist, or it is not a pingback-enabled resource.'=>'មិន​អាច​ប្រើ URL ដែល​បាន​បញ្ជាក់​នេះ​ជា​គោលដៅ​បាន​ទេ។ វា​មិន​មាន ឬ​ក៏​មិន​មែន​ជា​ប្រភព​ដែល​អនុញ្ញាត pingback។','The source URL and the target URL cannot both point to the same resource.'=>'URL ប្រភព និង URL គោលដៅ មិន​អាច​មាន​ទិសដៅ​ទៅ​កាន់​ប្រភព​ធនធាន​ដូច​គ្នា​ទេ។','The pingback has already been registered.'=>'Pingback ត្រូវ​បាន​ចុះ​បញ្ជី​រួច​រាល់​ហើយ។','The source URL does not exist.'=>'មិន​មាន URL ប្រភព។','We cannot find a title on that page.'=>'យើង​មិន​អាច​រក​ចំណង​ជើង​លើ​ទំព័រ​នោះ​ទេ។','The source URL does not contain a link to the target URL, and so cannot be used as a source.'=>'URL ប្រភព​មិន​មាន​តំណ​ភ្ជាប់​ណាមួយ​ទៅ​កាន់ URL គោលដៅ​ទេ ហើយ​វា​ក៏​មិន​អាច​ប្រើ​បាន​ដូច​ប្រភព​ដែរ។','Pingback from %1$s to %2$s registered. Keep the web talking! :-)'=>'បាន​ចុះ​បញ្ជី Pingback ពី %1$s ទៅ %2$s ។','The specified target URL does not exist.'=>'គ្មាន URL គោលដៅ​ដែល​បាន​បញ្ជាក់។','Select Menu:'=>'រើស​ម៉ឺនុយ:','Navigation Menu'=>'ម៉ឺនុយ​នាំ​ទិស','No menus have been created yet. <a href="%s">Create some</a>.'=>'មិន​ទាន់​បាន​បង្កើត​ម៉ឺនុយ​ទេ។ <a href="%s">បង្កើត​ម៉ឺនុយ</a> ។','Taxonomy:'=>'ចំណែក​ថ្នាក់:','You are about to permanently delete this menu. 
 \'Cancel\' to stop, \'OK\' to delete.'=>'អ្នក​កំពុង​តែ​លុបម៉ឺនុយនេះ​ចោល​ជា​អចិន្ត្រៃយ៍។
