...'=>'កំពុងដំឡើង %s...','themeInstalling %s...'=>'កំពុងដំឡើង %s...','plugin%s installed!'=>'បាន​ដំឡើង %s រួចរាល់!','theme%s installed!'=>'បាន​ដំឡើង %s រួចរាល់!','plugin%s installation failed'=>'ការ​ដំឡើង %s បាន​បរាជ័យ','theme%s installation failed'=>'ការ​ដំឡើង %s បាន​បរាជ័យ','pluginNetwork Activate %s'=>'បើក​ដំណើរការ %s នៅ​ក្នុង​បណ្ដាញ','pluginActivate %s'=>'បើក​ដំណើរការ %s','themeNetwork Activate %s'=>'បើក​ដំណើរការ %s នៅ​ក្នុង​បណ្ដាញ','themeActivate %s'=>'បើក​ដំណើរការ %s','Importer installed successfully. <a href="%s">Run importer</a>'=>'ការនាំចូលដំឡើងបានសម្រេច។ <a href="%s">ដំនើការ ការនាំចូល</a>','Run Importer'=>'អនុវត្ត​ការ​នាំចូល','Run %s'=>'អនុវត្ត %s','Search Results'=>'លទ្ធផល​ស្វែងរក','Theme starter contentFind Us'=>'ស្វែងរក​ពួក​យើង','Sorry, your entry could not be posted.'=>'សូមទោស មាតិការបស់អ្នកពុំអាចធ្វើការចេញផ្សាយបានទេ។','Sorry, your term could not be created.'=>'សូមទោស សព្ទរបស់អ្នកមិនអាចបង្កើតបានទេ។','Sorry, you are not allowed to edit this term.'=>'សូមទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យកែសម្រួលសព្ទនេះទេ។','Sorry, you are not allowed to delete this term.'=>'សូមទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យលុបសព្ទនេះទេ។ ','Sorry, you are not allowed to assign this term.'=>'សូមទោស អ្នកមិនត្រូវបានអនុញ្ញាតកំណត់សព្ទនេះទេ។','Invalid role.'=>'តួនាទីមិនត្រឹមត្រូវ។','Sorry, the comment could not be edited.'=>'សូមទោស ការផ្ដល់មតិមិនអាចត្រូវបានកែសម្រួលទេ។','Sorry, your entry could not be edited.'=>'សូមទោស អត្ថបទរបស់អ្នកពុំអាចធ្វើការកែប្រែបានទេ។','The REST API can no longer be completely disabled, the rest_authentication_errors filter can be used to restrict access to the API, instead.'=>'REST API មិនអាចបិទទាំងស្រុងបានទៀតទេ។ ចម្រោះ rest_authentication_errors អាចប្រើដើម្បីដាក់កំហិតការចូលទៅកាន់ API ជាជំនួសវិញ។','Whether to bypass trash and force deletion.'=>'ថាតើត្រូវចៀសវៀងពីធុងសំរាមហើយបង្ខំលុប។','Query parameter not permitted: %s'=>'ប៉ារ៉ាម៉ែត្រនៃ Query ពុំត្រូវបានអនុញ្ញាតនោះទេ៖ %s','Sorry, you must be logged in to comment.'=>'សូមទោស អ្នកត្រូវតែចូលសិនទើបអាចបញ្ចេញមតិបាន។','Cannot create existing comment.'=>'មិនអាចបង្កើតមតិដែលមានស្រាប់ហើយនោះទេ។','Creating a comment requires valid author name and email values.'=>'ការបង្កើតមតិមួយតម្រូវឱ្យមានឈ្មោះអ្នកបង្កើតដែលត្រឹមត្រូវ និងអ៊ីមែល។','Creating comment failed.'=>'ការបង្កើតមតិយោបល់ត្រូវបរាជ័យ។','Updating comment status failed.'=>'ការអាប់ដេតស្ថានភាពមតិយោបល់ត្រូវបរាជ័យ។','Updating comment failed.'=>'ការអាប់ដេតមតិយោបល់ត្រូវបរាជ័យ។','The comment has already been trashed.'=>'មតិយោបល់ត្រូវបានដាក់ក្នុងធុងសំរាមរួចហើយ។','The comment cannot be deleted.'=>'ការផ្ដល់មតិយោបល់មិនអាចលុបបានទេ។','Invalid comment author ID.'=>'ID អ្នកនិពន្ធមតិយោបល់មិនត្រឹមត្រូវ។','Unique identifier for the object.'=>'Unique identifier for the object.','The ID of the user object, if author was a user.'=>'ID នៃកម្មបទរបស់អ្នកប្រើ ប្រសិនបើអ្នកនិពន្ធគឺជាអ្នកប្រើ។','Email address for the object author.'=>'អាសយដ្ឋានអ៊ីម៉ែលសម្រាប់អ្នកនិពន្ធកម្មបទ។','IP address for the object author.'=>'អាសយដ្ឋាន IP សម្រាប់អ្នកនិពន្ធកម្មបទ។','Display name for the object author.'=>'បង្ហាញឈ្មោះសម្រាប់អ្នកនិពន្ធកម្មបទ។','URL for the object author.'=>'URL សម្រាប់អ្នកនិពន្ធកម្មបទ។','User agent for the object author.'=>'User agent សម្រាប់អ្នកនិពន្ធកម្មបទ។','The content for the object.'=>'មាតិកាសម្រាប់កម្មបទ។','Content for the object, as it exists in the database.'=>'មាតិកាសម្រាប់កម្មបទ ដូចដែលវាមាននៅក្នុងដេតាបេស។','HTML content for the object, transformed for display.'=>'មាតិកា HTML សម្រាប់ object នេះ, ត្រូវបានបម្លែងសម្រាប់ការបង្ហាញ។','URL to the object.'=>'URL ទៅកាន់កម្មបទ។','The ID for the parent of the object.'=>'ID សម្រាប់ប្រភពនៃកម្មបទ។','The ID of the associated post object.'=>'ID នៃកម្មបទប្រកាសដែលជាប់ទាក់ទង។','State of the object.'=>'សភាពនៃកម្មបទ។','Type of Comment for the object.'=>'ប្រភេទនៃមតិយោបល់សម្រាប់កម្មបទ។','Avatar URL with image size of %d pixels.'=>'URL នៃអវតាដែលរូបភាពមានទំហំ %d ភិចស៊ែល។','Avatar URLs for the object author.'=>'URLs នៃអវតាសម្រាប់អ្នកបង្កើត object នេះ។','Limit response to posts published after a given ISO8601 compliant date.'=>'កំណត់ការឆ្លើយតបទៅប្រកាសនានាដែលបានចេញផ្សាយ បន្ទាប់ពីមានការផ្ដល់ឲ្យនូវកាលបរិច្ឆេទជាប្រភេទ ISO8601 មួយ។','Limit result set to comments assigned to specific user IDs. Requires authorization.'=>'កំណត់ result set ទៅលើការបញ្ចេញមតិដែលកំណត់ទៅឲ្យ ID នៃអ្នកប្រើជាក់លាក់ណាមួយ។ ទាមទាឲ្យមានការផ្ដល់សិទ្ធិជាមុនសិន។','Ensure result set excludes comments assigned to specific user IDs. Requires authorization.'=>'ត្រូវប្រាកដថា result set ពុំរាប់បញ្ចូលនូវមតិនានាដែលភ្ជាប់ទៅ ID នៃអ្នកប្រើជាក់លាក់ណាមួយនោះទេ។ ទាមទាឲ្យមានការផ្ដល់សិទ្ធិជាមុន។','Limit result set to that from a specific author email. Requires authorization.'=>'កំណត់ result set ជាអ្វីដែលបានមកពីអ៊ីមែលរបស់អ្នកបង្កើតជាក់លាក់មួយ។ ទាមទាឲ្យមានការផ្ដល់សិទ្ធិជាមុន។','Limit response to posts published before a given ISO8601 compliant date.'=>'កំណត់ការឆ្លើយតបទៅនឹងប្រកាសនានាដែលបានចេញផ្សាយនៅមុនកាលបរិច្ឆេទតាម ISO8601 មួយដែលបានផ្តល់ឱ្យ។','Invalid status.'=>'ស្ថានភាពមិនត្រឹមត្រូវ។','Ensure result set excludes specific IDs.'=>'ត្រូវប្រាកដថា result set មិនរាប់បញ្ចូល specific IDs ទេ។','Limit result set to specific IDs.'=>'Limit result set to specific IDs.','Order sort attribute ascending or descending.'=>'លំដាប់នៃតម្លៃតម្រៀបជាលំដាប់ចុះ ឬលំដាប់ឡើង។','Sort collection by object attribute.'=>'តម្រៀប collection ដោយតម្លៃនៃ object ។','Limit result set to comments of specific parent IDs.'=>'Limit result set to comments of specific parent IDs.','Ensure result set excludes specific parent IDs.'=>'សូមច្បាស់ថា result set មិនបញ្ចូលនូវ specific parent IDs ទេ។','Limit result set to comments assigned to specific post IDs.'=>'Limit result set to comments assigned to specific post IDs.','Limit result set to comments assigned a specific status. Requires authorization.'=>'កំណត់ result set ទៅលើការបញ្ចេញមតិដែលកំណត់ទៅឲ្យប្រភេទនៃស្ថានភាព។ ទាមទាឲ្យមានការផ្ដល់សិទ្ធិជាមុនសិន។','Limit result set to comments assigned a specific type. Requires authorization.'=>'កំណត់ result set ទៅលើការបញ្ចេញមតិដែលកំណត់ទៅឲ្យប្រភេទជាក់លាក់មួយ។ ទាមទាឲ្យមានការផ្ដល់សិទ្ធិជាមុនសិន។','Method \'%s\' not implemented. Must be overridden in subclass.'=>'មេតូដ \'%s\' មិនត្រូវបានអនុវត្ត។ ត្រូវតែបាន override នៅក្នុង subclass ។','Current page of the collection.'=>'ទំព័របច្ចុប្បន្ននៃ collection។','Maximum number of items to be returned in result set.'=>'ចំនួនអតិបរមានៃធាតុដែលនឹងត្រូវបោះត្រឡប់មកវិញនៅក្នុងលទ្ធផលដែលបានកំណត់។','Limit results to those matching a string.'=>'កំណត់លទ្ធផលឲ្យពួកដែលដូចគ្នាទៅនឹង string  មួយ។','Scope under which the request is made; determines fields present in response.'=>'វិសាលភាពនៃការដែលសំណើត្រូវបានធ្វើឡើង; បញ្ជាក់ពី fields present នៅក្នុងការបោះមកវិញ។','Whether posts with this status should be private.'=>'ថាតើប្រកាសដែលមានស្ថានភាពប្រភេទនេះគួរតែស្ថិតជាឯកជន។','Whether posts with this status should be protected.'=>'ថាតើប្រកាសដែលមានស្ថានភាពប្រភេទនេះគួរតែត្រូវបានការពារឬទេ។','Whether posts of this status should be shown in the front end of the site.'=>'ថាតើប្រកាសដែលមានស្ថានភាពប្រភេទនេះគួរតែត្រូវបង្ហាញនៅផ្នែកខាងមុខនៃវេបសាយឬទេ។','Whether posts with this status should be publicly-queryable.'=>'ថាតើប្រកាសដែលមានស្ថានភាពប្រភេទនេះគួរតែត្រូវបានទាញយកជាសាធារណៈឬទេ។','Whether to include posts in the edit listing for their post type.'=>'ថាតើត្រូវរាប់បញ្ចូលប្រកាសនានាទៅក្នុងតំបន់កែប្រែនៃប្រភេទប្រកាសរបស់ពួកគេឬទេ។','Cannot view post type.'=>'មិនអាចមើលប្រភេទប្រកាសទេ។ ','Sorry, you are not allowed to manage post statuses.'=>'សូមទោស អ្នកពុំមានសិទ្ធិក្នុងការគ្រប់គ្រងស្ថានភាពរបស់ប្រកាសទាំងនេះទេ។','Permalink template for the object.'=>'ពុម្ភតំណសម្រាប់វត្ថុនេះ។','All capabilities used by the taxonomy.'=>'សមត្ថភាពទាំងអស់ដែលបានប្រើដោយបំណែងប្រភេទ។','A human-readable description of the taxonomy.'=>'ការពិពណ៌នាដែលអាចអានបានមួយនៃបំណែងប្រភេទនេះ។','Whether or not the taxonomy should have children.'=>'ថាតើគួរឬមិនគួរដែលបំណែងប្រភេទត្រូវមានកូនចៅ។','Human-readable labels for the taxonomy for various contexts.'=>'ស្លាកសញ្ញាដែលអាចអានបាននានាសម្រាប់បំណែងប្រភេទនៃបរិបទនានា។','The title for the post type.'=>'ចំនងជើង សម្រាប់ប្រភេទប្រកាស។ ','The password for the post if it is password protected.'=>'ពាក្យសម្ងាត់សម្រាប់ការប្រកាសនេះប្រសិនបើវាត្រូវបានការពារដោយពាក្យសម្ងាត់។','You need to define a search term to order by relevance.'=>'អ្នកត្រូវកំណត់សព្ទសម្រាប់ស្វែងរកមួយអោយតម្រៀបដោយភាពទាក់ទង។','Incorrect post password.'=>'ពាក្យសម្ងាត់នៃប្រកាសមិនត្រឺមត្រូវ។','Sorry, you are not allowed to create new users.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតអោយបង្កើតអ្នកប្រើថ្មីបានទេ។','Cannot create existing post.'=>'មិនអាចបង្កើតប្រកាសដែលមានស្រាប់ឡើយ។','Sorry, you are not allowed to edit comments.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតអោយកែសម្រួលលើមតិយោបល់ទេ។','The post has already been deleted.'=>'ការប្រកាសត្រូវបានលុបរួចហើយ។','A post can not be sticky and have a password.'=>'ការប្រកាសមួយមិនអាចជាប់ស្អិតហើយមានពាក្យសម្ងាត់នោះទេ។','A sticky post can not be password protected.'=>'ការប្រកាសស្អិតមិនអាចមានពាក្យសម្ងាត់ត្រូវការពារទេ។','A password protected post can not be set to sticky.'=>'ការប្រកាសដែលការពារដោយពាក្យសម្ងាត់មិនអាចដាក់អោយស្អិតបានទេ។','Invalid post parent ID.'=>'ID នៃប្រភពប្រកាសមិនត្រឺមត្រូវ។','Invalid featured media ID.'=>'ID នៃមេឌាពិសេសពុំត្រឹមត្រូវទេ។','The date the object was published, in the site\'s timezone.'=>'កាលបរិច្ឆេទនៃ object ត្រូវបានចេញផ្សាយរួចហើយ, នៅក្នុងល្វែងម៉ោងនៃវេបសាយ។','The date the object was published, as GMT.'=>'កាលបរិច្ឆេទនៃ object បានចេញផ្សាយរួចហើយ, ជាទម្រង់ GMT ។','The globally unique identifier for the object.'=>'The globally unique identifier for the object.','GUID for the object, as it exists in the database.'=>'GUID for the object, as it exists in the database.','GUID for the object, transformed for display.'=>'GUID for the object, transformed for display.','The date the object was last modified, in the site\'s timezone.'=>'កាលបរិច្ឆេទនៃ object បានកែប្រែចុងក្រោយគេរួចហើយ, នៅក្នុងល្វែងម៉ោងនៃវេបសាយ។','The date the object was last modified, as GMT.'=>'កាលបរិច្ឆេទនៃ object បានកែប្រែចុងក្រោយគេរួចហើយ, ជាទម្រង់ GMT ។','An alphanumeric identifier for the object unique to its type.'=>'An alphanumeric identifier for the object unique to its type.','A named status for the object.'=>'ស្ថានភាពមួយដែលមានឈ្មោះសម្រាប់កម្មបទ។','Type of Post for the object.'=>'ប្រភេទនៃប្រកាសសម្រាប់កម្មបទ។','The title for the object.'=>'ចំណងជើងសម្រាប់កម្មបទ។','Title for the object, as it exists in the database.'=>'ចំណងជើងសម្រាប់ object ដូចដែលមានស្រាប់នៅក្នុងដេតាបេស។','HTML title for the object, transformed for display.'=>'ចំណងជើងជា HTML នៃ object ត្រូវបានបម្លែងសម្រាប់ធ្វើការបង្ហាញ។','Whether the content is protected with a password.'=>'ថាតើអត្ថបទត្រូវបានការពារដោយពាក្យសម្ងាត់។','The ID for the author of the object.'=>'លេខ ID សម្រាប់អ្នកនិពន្ធនៃកម្មបទ។','The excerpt for the object.'=>'សម្រង់សម្រាប់កម្មបទ។','Excerpt for the object, as it exists in the database.'=>'សម្រង់សម្រាប់ object ដូចដែលមានស្រាប់នៅក្នុងដេតាបេស។','HTML excerpt for the object, transformed for display.'=>'សម្រង់ HTML នៃ object ត្រូវបានបម្លែងសម្រាប់ធ្វើការបង្ហាញ។','Whether the excerpt is protected with a password.'=>'ថាតើសម្រង់ត្រូវបានការពារដោយពាក្យសម្ងាត់ឬទេ។','The ID of the featured media for the object.'=>'ID នៃមេឌាពិសេសនៃវត្ថុនេះ។','Whether or not comments are open on the object.'=>'ថាតើការបញ្ចេញមតិត្រូវបានបើកឲ្យមានឬអត់។','Whether or not the object can be pinged.'=>'ថាតើ Object អាចត្រូវបាន pinged ដែរឬទេ។','The order of the object in relation to other object of its type.'=>'The order of the object in relation to other object of its type.','The format for the object.'=>'ទម្រង់សម្រាប់កម្មបទ។','Whether or not the object should be treated as sticky.'=>'ថាតើ Object គួរតែត្រូវចាត់ទុកជា sticky ដែរឬទេ។','A password to protect access to the content and excerpt.'=>'ពាក្យសម្ងាត់ដើម្បីការពារការចូលដំណើរការលើមាតិកា និងសេចក្ដីដកស្រង់។','The theme file to use to display the object.'=>'ឯកសារ​របស់​រូបរាង ដែល​ប្រើ​ដើម្បី​បង្ហាញ​អុបជិក។','The terms assigned to the object in the %s taxonomy.'=>'The terms assigned to the object in the %s taxonomy.','Limit result set to posts assigned to specific authors.'=>'Limit result set to posts assigned to specific authors.','Ensure result set excludes posts assigned to specific authors.'=>'ត្រូវប្រាកដថា result set មិនរាប់បញ្ចូលប្រកាសដែលបានកំណត់ទៅឲ្យអ្នកនិពន្ធជាក់លាក់ណាមួយនោះទេ។','Limit result set to posts with a specific menu_order value.'=>'កំណត់បណ្ដុំនៃលទ្ធផលជាប្រកាសជាមួយនឹង menu_order ដែលមានតម្លៃជាក់លាក់មួយ។','Offset the result set by a specific number of items.'=>'Offset the result set by a specific number of items.','Limit result set to items with particular parent IDs.'=>'Limit result set to items with particular parent IDs.','Limit result set to all items except those of a particular parent ID.'=>'Limit result set to all items except those of a particular parent ID.','Limit result set to all items that have the specified term assigned in the %s taxonomy.'=>'កំណត់ result set ទៅលើធាតុនានាដែលមានសព្ទជាក់លាក់កំណត់នៅក្នុងបំណែងប្រភេទ %s ។','Limit result set to items that are sticky.'=>'កំណត់បណ្ដុំលទ្ធផលជាធាតុទាំងឡាយដែលស្អិត។','Status is forbidden.'=>'ស្ថានភាពនេះត្រូវបានហាមឃាត់។','Invalid revision ID.'=>'ID កំណែលសម្រួលមិនត្រឹមត្រូវ។','Whether or not the term cloud should be displayed.'=>'ថាតើត្រូវបង្ហាញបណ្ដុំនៃសព្ទដែរឬទេ។','Limit results to taxonomies associated with a specific post type.'=>'កំណត់លទ្ធផលជាបំណែងប្រភេទដែលជាប់ទាក់ទងជាមួយនឹងប្រភេទប្រកាសជាក់លាក់មួយ។','Required to be true, as users do not support trashing.'=>'ទាមទារអោយកំណត់ជា true ព្រោះមិនអាចលុបអ្នកប្រើបានទេ។','Types associated with the taxonomy.'=>'ប្រភេទផ្សេងៗដែលមានទំនាក់ទំនងជាមួយបំណែងប្រភេទ។ ','Unique identifier for the user.'=>'ប្រភេទសម្គាល់តែមួយគត់សម្រាប់អ្នកប្រើ។','You are not currently logged in.'=>'ខណៈពេលនេះអ្នកមិនទាន់បានចូលទេ។','Cannot create existing user.'=>'មិនអាចបង្កើតអ្នកប្រើប្រាស់ថ្មីដែលមានហើយស្រាប់នោះទេ។','Sorry, you are not allowed to edit roles of this user.'=>'សូមទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យកែសម្រួលតួនាទីរបស់អ្នកប្រើនេះទេ។','Username isn\'t editable.'=>'ឈ្មោះអ្នកប្រើប្រាស់មិនអាចកែបានទេ។','Sorry, you are not allowed to delete this user.'=>'សុំទោស អ្នកមិនត្រូវបានបានអនុញ្ញាតអោយលុបអ្នកប្រើប្រាស់នេះឡើយ។','Invalid user ID for reassignment.'=>'ID​ របស់អ្នកប្រើប្រាស់សម្រាប់ការកំណត់ឡើងវិញមិនត្រឹមត្រូវទេ។','The role %s does not exist.'=>'តួនាទី %s មិនមានទេ។','Could not delete meta value from database.'=>'មិនអាចលុបតម្លៃមេតាពីដេតាបេសបានទេ។','Could not update meta value in database.'=>'មិនអាចអាប់ដេតតម្លៃមេតាទៅក្នុងដេតាបេសបានទេ។','Meta fields.'=>'ប្រអប់នៃ Meta។','%1$s is not one of %2$s.'=>'%1$s​ មិនមែនមួយនៅក្នុង %2$s ទេ។','Remove term:'=>'ដកសព្ទចេញ៖','Term selected.'=>'សព្ទបានជ្រើសយក។','Term added.'=>'សព្ទបានបន្ថែម។','Term removed.'=>'សព្ទ បានដលចេញ។','Sorry, you are not allowed to read comments without a post.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតអោយអានមតិដោយមិនបានប្រកាសនោះទេ។','Comment is required.'=>'ទាមទាអោយមានមតិយោបល់។','Limit result set to posts with one or more specific slugs.'=>'កំណត់បណ្ដុំលទ្ធផលជាប្រកាសជាមួយនឹង slug មួយឬច្រើនខុសៗគ្នា។','Taxonomies associated with post type.'=>'បំណែងប្រភេទនានាដែលមានទំនាក់ទំនងទៅនឹងប្រភេទប្រកាស។','Comment field exceeds maximum length allowed.'=>'ប្រអប់ផ្តល់មតិយោបល់ឡើងដល់កម្រិតខ្ពស់បំផុតដែលបានអនុញ្ញាត។','Limit result set to posts assigned one or more statuses.'=>'កំណត់បណ្ដុំលទ្ធផលជាប្រកាសដែលបានកំណត់ស្ថានភាពមួយឬច្រើន។','Limit result set to all items except those that have the specified term assigned in the %s taxonomy.'=>'កំណត់បណ្ដុំលទ្ធផលជាឈ្មោះចំណាត់ប្រភេទទាំងអស់ លើកលែងតែចំណាត់ប្រភេទដែលមានសព្ទជាក់លាក់ណាមួយដែលបានភ្ជាប់ទៅបំណែងប្រភេទ %s។','Invalid JSON body passed.'=>'JSON body មិនត្រឹមត្រូវ។','The title for the taxonomy.'=>'ចំណងជើងសម្រាប់បំណែងប្រភេទ។ ','The comment does not support trashing. Set \'%s\' to delete.'=>'មតិនេះមិនអាចលុបបានទេ។ កំណត់ \'%s\' ដើម្បីលុប។','The post does not support trashing. Set \'%s\' to delete.'=>'ប្រកាសនេះមិនអាចលុបបានទេ។ កំណត់\' %s\' ដើម្បីលុប។','Revisions do not support trashing. Set \'%s\' to delete.'=>'កំណែសម្រួលទាំងនេះមិនអាចលុបបានឡើយ។ កំណត់ \'%s\' ដើម្បីលុប។ ','Users do not support trashing. Set \'%s\' to delete.'=>'អ្នកប្រើ មិនគាំទ្រនូវការលុបចោលនោះទេ។ កំណត់ \'%s\' ដើម្បីលុប។','REST base route for the taxonomy.'=>'REST ជាផ្លូវមូលដ្ឋានសម្រាប់បំណែងប្រភេទ។','Invalid user parameter(s).'=>'ប៉ារ៉ាមែត្រអ្នកប្រើមិនត្រឹមត្រូវ។
