e %s custom field.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យកែសម្រួលទម្រង់ផ្ទាល់ខ្លួន %s បានទេ។','Theme starter contentAbout This Site'=>'អំពី​វេបសាយ​នេះ','Theme starter contentThis may be a good place to introduce yourself and your site or include some credits.'=>'ទីនេះអាចជាកន្លែងល្អមួយដើម្បីណែនាំខ្លួនរបស់អ្នក និងវេបសាយរបស់អ្នក ឬក៏រួមជាមួយនឺងក្រេឌីតមួយចំនួនផងដែរ។','Theme starter contentFoursquare'=>'Foursquare','Theme starter contentGitHub'=>'GitHub','Theme starter contentLinkedIn'=>'LinkedIn','Theme starter contentPinterest'=>'Pinterest','Theme starter contentYouTube'=>'YouTube','Sorry, you are not allowed to read this comment.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យអានមតិយោបល់នេះឡើយ។','Sorry, you are not allowed to read the post for this comment.'=>'សូមទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យអានប្រកាសដែលមានមតិយោបល់នេះឡើយ។','Sorry, you are not allowed to edit \'%s\' for comments.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យកែប្រែ %s ក្នុងការបញ្ចេញមតិទេ។','Sorry, you are not allowed to create this comment without a post.'=>'សូមទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យបង្កើតមតិយោបល់ដោយមិនបានប្រកាសនោះទេ។','Sorry, you are not allowed to create a comment on this post.'=>'សូមទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យបញ្ចេញមតិលើប្រកាសនេះទេ។','Sorry, you are not allowed to view revisions of this post.'=>'សូមទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យមើលកំណែសម្រួលនៃការប្រកាសនេះទេ។','Sorry, you are not allowed to delete this comment.'=>'សូមទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យលុបមតិយោបល់នេះទេ។','Sorry, you are not allowed to filter users by role.'=>'សូមទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យច្រោះអ្នកប្រើប្រាស់ដោយតួនាទីនោះទេ។','Sorry, you are not allowed to order users by this parameter.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យតម្រៀបអ្នកប្រើប្រាស់ដោយប្រើប៉ារ៉ាម៉ែត្រនេះបានទេ។','Sorry, you are not allowed to give users that role.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យផ្ដល់ឱ្យអ្នកប្រើនៅតួនាទីនោះឡើយ។','Sorry, you are not allowed to change the comment type.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យផ្លាស់ប្តូរប្រភេទមតិយោបល់នេះទេ។','Theme starter contentCalendar'=>'ប្រតិទិន​','Theme starter contentMeta'=>'មេតា','Theme starter contentRecent Comments'=>'មតិយោបល់ថ្មី','Theme starter contentRecent Posts'=>'ប្រកាស​ថ្មី​ៗ','Theme starter contentWelcome to your site! This is your homepage, which is what most visitors will see when they come to your site for the first time.'=>'សូមស្វាគមន៍មកកាន់វេបសាយរបស់អ្នក! នេះគឺជាទំព័រដើមរបស់អ្នក ដែលជាទំព័រមួយដែលអ្នកចូលមើលភាគច្រើននឹងឃើញនៅពេលដែលពួកគេមកដល់វេបសាយរបស់អ្នកជាលើកដំបូង។','Theme starter contentYou might be an artist who would like to introduce yourself and your work here or maybe you&rsquo;re a business with a mission to describe.'=>'អ្នកអាចជាអ្នកបុិនប្រសព្វដែលចង់បង្ហាញពីខ្លួនអ្នក និងការងាររបស់អ្នកនៅទីនេះ ឬក៏ប្រហែលជាអ្នកជំនួញដែលមានបេសកកម្មសម្រាប់បរិយាយ។','Theme starter contentThis is a page with some basic contact information, such as an address and phone number. You might also try a plugin to add a contact form.'=>'នេះជាទំព័រមួយដែលមានព័ត៌មានទំនាក់ទំនងជាមូលដ្ឋានមួយចំនួន ដូចជាអាសយដ្ឋាន និងលេខទូរស័ព្ទ។ អ្នកក៏អាចសាកល្បងប្រើកម្មវិធីជំនួយដើម្បីបន្ថែមទម្រង់ទំនាក់ទំនង។','Theme starter contentNews'=>'ដំណឹង​','Theme starter contentThis is an example of a homepage section. Homepage sections can be any page other than the homepage itself, including the page that shows your latest blog posts.'=>'នេះគឺជាឧទាហរណ៍នៃផ្នែកមួយនៃទំព័រដើម។ ផ្នែកនៃទំព័រដើមអាចជាទំព័រផ្សេងៗដែលមិនមែនជាទំព័រដើមខ្លួនវា រួមបញ្ចូលទាំងទំព័រដែលបង្ហាញនូវការប្រកាសថ្មីៗរបស់អ្នកផងដែរ។','Theme starter contentArchives'=>'បណ្ណសារ','Video is paused.'=>'វីដេអូ បានផ្អាក។','Video is playing.'=>'វីដេអូ កំពុងតែចាក់។ ','The user cannot be deleted.'=>'អ្នក​ប្រើប្រាស់​នេះ មិន​​អាច​លុប​បាន។ ','Invalid date.'=>'កាលបរិច្ឆេទមិនត្រឹមត្រូវ។','Invalid JSONP callback function.'=>'មុខងារ callback JSONP មិនត្រឹមត្រូវ។','Invalid comment content.'=>'ការផ្តល់មត្តិយោបល់មិនត្រឹមត្រូវ។','Invalid email address.'=>'អាសយដ្ឋានអ៊ីមែលមិនត្រឹមត្រូវ។','Invalid slug.'=>'slug មិនត្រឹមត្រូវ។','Cannot create a comment with that type.'=>'មិនអាចបង្កើតមតិ ជាមួយប្រភេទនោះទេ។ ','RSS Error:'=>'កំហុស​RSS:','Cannot view status.'=>'មិនអាចមើលស្ថានភាពនេះបានទេ។','The title for the status.'=>'ចំណងជើងសម្រាប់ស្ថានភាពនេះ។','Cannot set parent term, taxonomy is not hierarchical.'=>'មិនអាចកំណត់មេនៃសព្ទបានទេ បំណែងប្រភេទមិនមែនជាឋានានុក្រម។','Sorry, you are not allowed to view themes.'=>'សូមទោស អ្នកពុំមានសិទ្ធិក្នុងការមើលរូបរាងនេះទេ។','Error creating new user.'=>'កំហុស​ពេល​កំពុង​បង្កើត​អ្នក​​ប្រើប្រាស់​ថ្មី។ ','Limit response to comments published after a given ISO8601 compliant date.'=>'កំណត់ការឆ្លើយតបទៅនឹងមតិដែលបានចេញផ្សាយបន្ទាប់ពីកាលបរិច្ឆេទមួយដែលបានផ្តល់ឲ្យ ហើយដែលគាំទ្រ ISO8601។','Limit response to comments published before a given ISO8601 compliant date.'=>'កម្រិត​ការ​ឆ្លើយតប​ចំពោះ​មតិ​ទាំងឡាយ​ណា​ដែល​បាន​ចេញ​ផ្សាយ​មុន​កាលបរិច្ឆេទ​ដែល​អនុលោម​តាម ISO8601។','An alphanumeric identifier for the status.'=>'តួអក្សរ និងលេខសំគាល់សំរាប់ status។','All capabilities used by the post type.'=>'សមត្ថភាពទាំងអស់ដែលបានប្រើដោយប្រភេទការប្រកាសនេះ។','A human-readable description of the post type.'=>'សេចក្ដីអធិប្បាយមួយដែលមនុស្សអាចអានបាននៃប្រភេទប្រកាសនេះ។','Whether or not the post type should have children.'=>'ទោះបីជាយ៉ាងណាក៏ដោយ ប្រភេទប្រកាសគួរមានកូន។','Human-readable labels for the post type for various contexts.'=>'ស្លាកនានាដែលមនុស្សអាចអានបានសម្រាប់ប្រភេទប្រកាសនេះ ក្នុងគ្រប់បរិបទនានា។','An alphanumeric identifier for the post type.'=>'គ្រឿងសម្គាល់អក្សរក្រមលេខមួយសម្រាប់ប្រភេទប្រកាស។','REST base route for the post type.'=>'REST ជាផ្លូវមូលដ្ឋានសម្រាប់ប្រភេទនៃប្រកាស។','Required to be true, as revisions do not support trashing.'=>'ទាមទារអោយដាក់ទៅ true ដោយសារកំណែសម្រួលមិនអាចលុបបាន។','An alphanumeric identifier for the taxonomy.'=>'តួអក្សរ និង លេខសំគាល់សំរាប់ taxonomy។','The password for the parent post of the comment (if the post is password protected).'=>'ពាក្យសម្ងាត់សម្រាប់មតិយោបល់មេ (ប្រសិនបើប្រកាសនោះត្រូវបានការពារដោយពាក្យសម្ងាត់)។','All features, supported by the post type.'=>'គ្រប់លក្ខណៈទាំងអស់ត្រូវបានគាំទ្រដោយប្រភេទប្រកាស។','You need to define an include parameter to order by include.'=>'អ្នកត្រូវកំណត់នូវប៉ារ៉ាម៉ែត្របញ្ចូលមួយដោយតម្រៀបតាមការដាក់បញ្ចូល។','The page number requested is larger than the number of pages available.'=>'លេខទំព័រដែលបានស្នើគឺមានទំហំធំជាងចំនួននៃទំព័រដែលអាចប្រើបាន។','pluginUpdated!'=>'បានអាប់ដេត!','themeUpdated!'=>'បានអាប់ដេត!','pluginUpdate %s now'=>'អាប់ដេត %s ឥឡូវ​នេះ','pluginUpdating %s...'=>'កំពុងអាប់ដេត %s...','plugin%s updated!'=>'%s ត្រូវបានអាប់ដេត!','plugin%s update failed'=>'%s អាប់ដេតបរាជ័យ','pluginInstall %s now'=>'ដំឡើង %s ឥឡូវ​នេះ','pluginInstalled!'=>'បានដំឡើង!','themeInstalled!'=>'បានដំឡើង!','pluginDeleted!'=>'លុប!','themeDeleted!'=>'លុប!','Displays an audio player.'=>'បង្ហាញកម្មវិធីចាក់អូឌីយ៉ូ។','No audio selected'=>'គ្មានអូឌីយ៉ូណាមួយត្រូវបានជ្រើសរើស','label for button in the audio widget; should preferably not be longer than ~13 characters longReplace Audio'=>'ជំនួសអូឌីយ៉ូ','label for button in the audio widget; should preferably not be longer than ~13 characters longEdit Audio'=>'កែសម្រួលអូឌីយ៉ូ','We can&#8217;t find that audio file. Check your <a href="%s">media library</a> and make sure it wasn&#8217;t deleted.'=>'យើងរកមិនឃើញឯកសារអូឌីយ៉ូនោះទេ។​ សូមពិនិត្យមើល <a href="%s">បណ្ណាល័យមេឌា</a> របស់អ្នក និងសូមប្រាកដថាវាមិនត្រូវបានលុបចោល។','Audio Widget (%d)'=>'អូឌីយ៉ូវិដជិត (%d)','Audio Widget'=>'អូឌីយ៉ូវិដជិត','Looks like this isn&#8217;t the correct kind of file. Please link to an audio file instead.'=>'មើលទៅវាដូចជាមិនមែនជាប្រភេទនៃឯកសារត្រឹមត្រូវទេ។ សូមតភ្ជាប់ទៅឯកសារអូឌីយ៉ូជំនួសវិញ។','URL to the %s audio source file'=>'URL ទៅនឺង​ប្រភពឯកសារអូឌីយ៉ូ %s','Unable to preview media due to an unknown error.'=>'មិនអាចមើលមេឌាដោយសារតែកំហុសដែលមិនស្គាល់មួយ។','Displays an image.'=>'បង្ហាញរូបភាពមួយ។','label for button in the gallery widget; should not be longer than ~13 characters longEdit Gallery'=>'កែប្រែវិចិត្រសាល','label for button in the image widget; should preferably not be longer than ~13 characters longReplace Image'=>'ជំនួសរូបភាព','label for button in the image widget; should preferably not be longer than ~13 characters longEdit Image'=>'កែសម្រួលរូបភាព','We can&#8217;t find that image. Check your <a href="%s">media library</a> and make sure it wasn&#8217;t deleted.'=>'យើងរកមិនឃើញរូបភាពនោះទេ។ សូមពិនិត្យមើល <a href="%s">បណ្ណាល័យមេឌា</a> របស់អ្នក ហើយប្រាកដថាវាមិនត្រូវបានលុប។','Image Widget (%d)'=>'វិដជិតរូបភាព (%d)','Image Widget'=>'វិដជិតរូបភាព','Displays a video from the media library or from YouTube, Vimeo, or another provider.'=>'បង្ហាញវីដេអូមួយពីបណ្ណាល័យមេឌាឬពីគេហទំព័រ YouTube, Vimeo, ឬអ្នកផ្តល់សេវាផ្សេងទៀត។','label for button in the gallery widget; should not be longer than ~13 characters longAdd Images'=>'បន្ថែមរូបភាព','label for button in the video widget; should preferably not be longer than ~13 characters longReplace Video'=>'ជំនួសវីដេអូ','label for button in the video widget; should preferably not be longer than ~13 characters longEdit Video'=>'កែសម្រួលវីឌីអូ','We can&#8217;t find that video. Check your <a href="%s">media library</a> and make sure it wasn&#8217;t deleted.'=>'យើងរកមិនឃើញវីឌីអូនោះទេ។ សូមរកមើលនៅក្នុង <a href="%s">បណ្ណាល័យមេឌា</a>របស់អ្នក និងប្រាកដថាវាមិនត្រូវបានលុប។','Video Widget (%d)'=>'វីដេអូវិដជិត (%d)','Video Widget'=>'វីដេអូវិដជិត','URL to the %s video source file'=>'URL ទៅឯកសារប្រភពវីដេអូ %s','A media item.'=>'មេឌាមួយឯកតា។','No media selected'=>'គ្មានមេឌាណាមួយត្រូវបានជ្រើសរើស','label for button in the media widget; should preferably not be longer than ~13 characters longReplace Media'=>'ជំនួសមេឌា','label for button in the media widget; should preferably not be longer than ~13 characters longEdit Media'=>'កែប្រែមេឌា','Add to Widget'=>'បន្ថែមទៅវិដជិត','We can&#8217;t find that file. Check your <a href="%s">media library</a> and make sure it wasn&#8217;t deleted.'=>'យើងរកមិនឃើញឯកសារនោះទេ។ សូមពិនិត្យមើល <a href="%s">បណ្ណាល័យមេឌា</a> របស់អ្នក និងសូមប្រាកដថាវាមិនត្រូវបានលុប។','Media Widget (%d)'=>'មេឌាវិដជិត (%d) ','Media Widget'=>'វិដជិតមេឌា','Looks like this isn&#8217;t the correct kind of file. Please link to an appropriate file instead.'=>'មើលទៅដូចជាមិនមែនជាឯកសារប្រភេទដែលត្រឹមត្រូវនោះទេ។ សូមតភ្ជាប់ទៅឯកសារសមរម្យជំនួសវិញ។','Attachment post ID'=>'Attachment post ID','URL to the media file'=>'URL​ ទៅឯកសារមេឌា','Title for the widget'=>'ចំណងជើងសម្រាប់វិដជិត','Enter your closest city to find nearby events.'=>'បញ្ចូលទីក្រុងជិតបំផុតរបស់អ្នកដើម្បីរកព្រឹត្តិការណ៍នានានៅក្បែរនោះ។','An error occurred. Please try again.'=>'កំហុស​មួយ​បាន​កើត​ឡើង។ សូម​ព្យាយាម​ម្ដងទៀត។','Attend an upcoming event near you.'=>'ចូលរួមព្រឹត្តិការណ៍ដែលនៅជិតអ្នក។','We couldn&#8217;t locate %s. Please try another nearby city. For example: Kansas City; Springfield; Portland.'=>'យើងមិនអាចកំណត់ទីតាំង %s បានទេ។ សូមព្យាយាមទីក្រុងផ្សេងទៀតដែលក្បែរអ្នក។ ឧទាហរណ៍: ទីក្រុង កាន់សាស់, ស្ព្រីងហ្វៀល, ឬ ផតលែន។','City updated. Listing events near %s.'=>'បាន​អាប់ដេត​ទីក្រុង។ ការ​បង្ហាញ​ព្រឹត្តិការណ៍​នៅ​ក្បែរ %s។','label for button in the audio widgetAdd Audio'=>'បន្ថែមសម្លេង','label for button in the image widgetAdd Image'=>'បន្ថែមរូបភាព','label for button in the video widgetAdd Video'=>'បន្ថែមវីដេអូ','label for button in the media widgetAdd Media'=>'បន្ថែមមេឌៀ','Show tag counts'=>'បង្ហាញចំនួនស្លាក','Arbitrary HTML code.'=>'កូដ HTML បំពាន។','Custom HTML'=>'HTML ផ្ទាល់ខ្លួន','Some HTML tags are not permitted, including:'=>'HTML tags ខ្លះមិនត្រូវបានអនុញ្ញាតនោះទេ មានដូចជា៖','Arbitrary text.'=>'អត្ថបទបំពាន។','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'វិដជិតនេះអាចមានកូដដែលដំណើរការល្អជាងជាមួយនឹងវិដជិត &#8220;HTML ផ្ទាល់ខ្លួន&#8221;។ តើអ្នកចង់ប្រើវិដជិតនោះជំនួសដែររឺទេ?','New Custom HTML Widget'=>'វិដជិត HTML ផ្ទាល់ខ្លួនថ្មី','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'តើអ្នកបានដឹងទេថា ពេលនេះយើងមានវិដជិត &#8220;Custom HTML#8221;? អ្នកអាចរកវាបានដោយចុចលើប៊ូតុង &#8220;<a class="add-widget" href="#">បន្ថែមវិដជិត</a>&#8221; ហើយស្វែងរកពាក្យថា &#8220;HTML&#8221;។ សូមសាកល្បងវាដើម្បីបន្ថែមនូវកូដមួយចំនួនទៅក្នុងវេបសាយរបស់អ្នក។','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'តើអ្នកបានដឹងទេថា ពេលនេះយើងមានវិដជិត &#8220;HTML ផ្ទាល់ខ្លួន&#8221; ? អ្នកអាចរកវាបានដោយរកមើលនៅក្នុងបញ្ជីវិដជិតមានស្រាប់នៅលើផ្ទាំងនេះ។ ចូរសាកល្បងវាដើម្បីបន្ថែមនូវកូដផ្ទាល់ខ្លួនមួយចំនួនទៅក្នុងវេបសាយរបស់អ្នក។','Did you just paste HTML?'=>'តើ​អ្នក​បាន​បិទភ្ជាប់​កូដ HTML មែនទេ?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'សួស្ដី អ្នកដូចជាបានបិទភ្ជាប់កូដ HTML ទៅក្នុងធែប &#8220;ឃើញផ្ទាល់&#8221; នៃវិដជិតអក្សរ។ ប្រហែលជាអ្នកចង់បិទភ្ជាប់កូដរបស់អ្នកទៅក្នុងធែប &#8220;អក្សរ&#8221; ទៅវិញទេ។ ជម្រើសមួយទៀត គឺសូមសាកល្បងនូវវិដជិត &#8220;HTML ផ្ទាល់ខ្លួន&#8221; ក៏បាន។','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you haven&#8217;t yet, how about trying that widget instead?'=>'វិដជិតនេះអាចនឹងមានកូដដែលដំណើរការបានល្អជាង នៅក្នុងវិដជិត &#8220;HTML ផ្ទាល់ខ្លួន&#8221;។ ប្រសិនបើអ្នកមិនមានកូដណាមួយទេ តើអ្នកចង់សាកល្បងប្រើវាទេ?','Unable to save due to %s invalid setting.'=>'មិនអាចរក្សាទុកបានទេដោយសារតែមានការកំណត់ %s មិនត្រឹមត្រូវ។','Publish Settings'=>'ការកំណត់ដើម្បីចុះផ្សាយ','When using a keyboard to navigate:'=>'នៅពេលប្រើប្រាស់ក្ដារចុចដើម្បីរុករក:','In the editing area, the Tab key enters a tab character.'=>'នៅក្នុងតំបន់កែសម្រួល គ្រាប់ចុច Tab បង្កើតបានជាអក្ស tab មួយ។','To move away from this area, press the Esc key followed by the Tab key.'=>'ដើម្បីចាកចេញពីតំបន់នេះ សូមចុចលើគ្រាប់ចុច Esc ជាមួយនឹងគ្រាប់ចុច Tab។','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'សម្រាប់អ្នកប្រើដែលប្រើអេក្រង់អាន៖ នៅពេលដែលស្ថិតនៅក្នុងទម្រង់បំពេញបែបបទ អ្នកអាចនឹងត្រូវការចុចលើគ្រប់ចុច Esc ចំនួនពីរដង។','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'ប្រអប់កែប្រែហាយឡាយស៊ីនតាក់របស់កូដជាស្វ័យប្រវត្តិ។ អ្នកអាចបិទមិនអោយវាហាយឡាយនៅក្នុង <a href="%1$s" %2$s>ទម្រង់អ្នកប្រើ%3$s</a> របស់អ្នក ដើម្បីធ្វើការតែនៅលើទម្រង់អក្សរសុទ្ធ។','Method \'%s\' must be overridden.'=>'មេតូដ \'%s\' ត្រូវតែលុបលើ។','Are you sure you&#8217;d like to discard your unpublished changes?'=>'តើអ្នកពិតជាចង់បោះបង់នូវកំណែប្រែដែលមិនទាន់បានបោះពុម្ភផ្សាយរបស់អ្នកមែនឬ?','There is a more recent autosave of your changes than the one you are previewing. <a href="%s">Restore the autosave</a>'=>'មានការរក្សាទុកដោយស្វ័យប្រវត្តិថ្មីមួយបន្ថែមទៀតនៃការកែប្រែរបស់អ្នកទៅលើអ្វីដែលអ្នកកំពុងតែមើលផ្ទាល់នេះ។ <a href="%s">ស្ដានូវកំណែចុងក្រោយនោះ</a>','Homepage and posts page must be different.'=>'ទំព័រដើម និងទំព័រប្រកាសត្រូវតែខុសគ្នា។','Schedule your customization changes to publish ("go live") at a future date.'=>'កំណត់ពេលអោយកំណែប្រែរបស់អ្នកដើម្បីដាក់អោយដំណើរការ ("go live") នៅថ្ងៃអនាគត។','Installation Failed!'=>'ការតំឡើងបរាជ័យ!','Sorry, you can&#8217;t preview new themes when you have changes scheduled or saved as a draft. Please publish your changes, or wait until they publish to preview new themes.'=>'សុំទោស អ្នកមិនអាចមើលជាមុននូវរូបរាងវេបសាយរបស់អ្នកបានទេ នៅពេលដែលអ្នកបានកំណត់ពេលក្នុងការកែប្រែ ឬក៏បានរក្សាវាទុកជាពង្រៀង។ សូមដាក់អោយដំណើរការនូវកំណែប្រែរបស់អ្នក ឬក៏រង់ចាំដល់ពេលដែលកំណែប្រែទាំងនោះដំណើរការ ដើម្អាចមើលជាមុនបាន។','Clear color'=>'លុបពណ៌','Color value'=>'តម្លៃនៃពណ៌','Use the Custom HTML widget to add arbitrary HTML code to your widget areas.'=>'ប្រើ HTML វិដជិតផ្ទាល់ខ្លួនដើម្បីបន្ថែម កូដ HTML កែច្នៃទៅតំបន់វិដជិតរបស់អ្នក។','Custom HTML Widget'=>'HTML វិដជិតផ្ទាល់ខ្លួន','Gallery'=>'វិចិត្រសាល','Displays an image gallery.'=>'បង្ហាញវិចិត្រសាលនៃរូបភាពមួយ។','No images selected'=>'គ្មានរូបណាត្រូវបានជ្រើសរើសឡើយ','Link to:'=>'ភ្ជាប់ទៅកាន់:','%s has taken over and is currently customizing.'=>'%s ត្រូវបានគ្រប់គ្រង និងកំពុងតែកែសម្រួល។','Add a navigation menu to your sidebar.'=>'បន្ថែមម៉ឺនុយរុករកមួយទៅលើសាយបាររបស់អ្នក។','post action/button labelSchedule'=>'កំណត់ពេល','Sorry, we can&#8217;t load the video at the supplied URL. Please check that the URL is for a supported video file (%s) or stream (e.g. YouTube and Vimeo).'=>'សូមទោស យើងពុំអាចទាញយកនូវវីដេអូពី URL ដែលបានផ្ដល់ឲ្យទេ។ សូមពិនិត្យថាតើ URL នោះ គឺជាហ្វាល់វីដេអូដែលយើងគាំទ្រ (%s) ឬក៏ជាតំណបន្តផ្ទាល់ (ឧទាហណ៍ដូចជា YouTube និង Vimeo ជាដើម)។','You won&#8217;t be able to install new themes from here yet since your install requires SFTP credentials. For now, please <a href="%s">add themes in the admin</a>.'=>'អ្នកនឹងពុំអាចតម្លើងរូបរាងវេបសាយថ្មីពីទីនេះបាននៅឡើយទេ ដោយសារតែការតម្លើងរបស់អ្នកទាមទាឲ្យមានលេខសម្ងាត់ SFTP។ សម្រាប់ពេលនេះ សូម<a href="%s">បញ្ចូលរូបរាងវេបសាយទៅក្នុងតំបន់គ្រប់គ្រង</a>សិន។','Whether or not the post type can be viewed.'=>'ថាតើប្រភេទប្រកាសនេះអាចមើលបានដែរឬទេ។','Sorry, you are not allowed to query users by this parameter.'=>'សូមទោស អ្នកពុំមានសិទ្ធិក្នុងការទាញយកព័ត៌មានពីអ្នកប្រើដោយប្រើប៉ារ៉ាមែត្រនេះទេ។','No personal data was found for this user.'=>'ពុំមានឃើញនូវទិន្នន័យផ្ទាល់ខ្លួនសម្រាប់អ្នកប្រើនេះទេ។','All of the personal data found for this user was erased.'=>'ទិន្នន័យផ្ទាល់ខ្លួនទាំងអស់ដែលបានរកឃើញសម្រាប់អ្នកប្រើនេះ បានលុបហើយ។','Personal data was found for this user but was not erased.'=>'ទិន្នន័យផ្ទាល់ខ្លួនត្រូវបានរកឃើញសម្រាប់អ្នកប្រើនេះហើយ ប៉ុន្តែវាត្រូវបានលុប។','Personal data was found for this user but some of the personal data found was not erased.'=>'ទិន្នន័យផ្ទាល់ខ្លួនបានរកឃើញសម្រាប់អ្នកប្រើនេះ ប៉ុន្តែមានទិន្នន័យផ្ទាល់ខ្លួនដែលបានរកឃើញខ្លះត្រូវបានលុប។','An error occurred while attempting to find and erase personal data.'=>'មានកំហុសមួយកើតឡើងកំឡុងពេលព្យាយាមស្វែងរក និងលុបនូវទិន្នន័យផ្ទាល់ខ្លួន។','No personal data export file was generated.'=>'ពុំមានទិន្នន័យផ្ទាល់ខ្លួនសម្រាប់នាំចេញណាមួយត្រូវបានធ្វើឡើងនោះទេ។','An error occurred while attempting to export personal data.'=>'មានកំហុសមួយកើតឡើងកំឡុងពេលនាំចេញទិន្នន័យផ្ទាល់ខ្លួន។','The current user can publish this post.'=>'អ្នកប្រើនេះអាចចេញផ្សាយប្រកាសនេះបាន។','The current user can sticky this post.'=>'អ្នកប្រើនេះអាចបិទភ្ជាប់ប្រកាសនេះបាន។','The current user can change the author on this post.'=>'អ្នកប្រើនេះអាចប្ដូរអ្នកនិពន្ធសម្រាប់ប្រកាសនេះបាន។','The current user can assign terms in the %s taxonomy.'=>'អ្នកប្រើនេះអាចកំណត់សព្ទទៅក្នុងបំណែងប្រភេទ %s បាន។','The current user can create terms in the %s taxonomy.'=>'អ្នកប្រើនេះអាចបង្កើតសព្ទនៅក្នុងបំណែងប្រភេទ %s បាន។','The offset number requested is larger than or equal to the number of available revisions.'=>'លេខអុហ្វសិតដែលស្នើសុំមានទំហំធំជាងឬស្មើនឹងចំនួនកំណែដែលមាន។','No archives to show.'=>'ពុំមានបណ្ណសារដែលត្រូវបង្ហាញនោះទេ','%1$s on %2$s'=>'%1$s លើ %2$s','No comments to show.'=>'ពុំមានមតិដែលត្រូវបង្ហាញទេ។','Slug automatically generated from the object title.'=>'Slug ត្រូវបានបង្កើតឡើងដោយស្វ័យប្រវត្តិពីចំណងជើងនៃវត្ថុ។','Version of the content block format used by the object.'=>'កំែណនៃទម្រង់មាតិការបស់ប្លុកដែលប្រើជាមួយនឹងវត្ថុនេះ។','The current user can post unfiltered HTML markup and JavaScript.'=>'អ្នកប្រើប្រាស់នេះអាចប្រកាសនូវកូដ HTML និងកូដ JavaScript ដោយពុំចាំបាច់ច្រោះ។','REST search handlers must extend the %s class.'=>'ការស្វែងរក REST ត្រូវតែ extend %s class.','Internal search handler error.'=>'ការរុករកផ្ទៃក្នុងមានកំហុស។','Object type.'=>'ប្រភេទនៃវត្ថុ។','Object subtype.'=>'ប្រភេទរងនៃវត្ថុ','Limit results to items of an object type.'=>'កំណត់លទ្ធផលជាធាតុនានានៃប្រភេទវត្ថុមួយ។','Limit results to items of one or more object subtypes.'=>'កំណត់លទ្ធផលជាធាតុនានានៃប្រភេទរងរបស់វត្ថុមួយឬច្រើន។','Invalid type parameter.'=>'ប៉ារ៉ាម៉ែត្រប្រភេទពុំត្រឹមត្រូវ។','The visibility settings for the taxonomy.'=>'ការកំណត់ពីភាពមើលឃើញសម្រាប់បំណែងប្រភេទ។','Features supported by this theme.'=>'ប្រកាសពិសេសត្រូវបានគាំទ្រដោយរូបរាងវេបសាយនេះ។','Post formats supported.'=>'ទម្រង់នៃប្រកាសត្រូវបានគាំទ្រ។','Whether the th