បស់​កម្មវិធី​អ៊ីនធឺណិត%2$s។','&#8220;%s&#8221; has failed to upload.'=>'អាប់ឡូត &#8220;%s&#8221; មិន​បាន​សម្រេច។','Invalid taxonomy.'=>'ខុស​បំណែង​ប្រភេទ។','%s exceeds the maximum upload size for the multi-file uploader when used in your browser.'=>'%s លើស​ទំហំ​អាប់ឡូត​អតិបរមា​សម្រាប់​ឧបករណ៍​អាប់ឡូត​ឯកសារ​ច្រើន​រួម​គ្នា ពេល​ប្រើ​ក្នុង​កម្មវិធី​អ៊ីនធឺណិត​របស់​អ្នក។','About WordPress'=>'អំពី WordPress','%s exceeds the maximum upload size for this site.'=>'%s លើស​ទំហំ​អាប់ឡូត​អតិបរមា​របស់​វេបសាយ​នេះ។','Your site at %1$s is active. You may now log in to your site using your chosen username of &#8220;%2$s&#8221;. Please check your email inbox at %3$s for your password and login instructions. If you do not receive an email, please check your junk or spam folder. If you still do not receive an email within an hour, you can <a href="%4$s">reset your password</a>.'=>'វេបសាយ​របស់​អ្នក%1$s កំពុងដំណើរ​ការ​ហើយ។ ពេលនេះអ្នកអាចចូលប្រើក្នុង​វេបសាយ​របស់​អ្នក ដោយ​ប្រើ​ឈ្មោះ​ដែលបាន​ជ្រើស &#8220;%2$s&#8221;។ សូម​ពិនិត្យ​ប្រអប់​អ៊ីមែល​របស់​អ្នក​ %3$s សម្រាប់​ពាក្យ​សម្ងាត់ ​និង​សេចក្ដី​ណែនាំ​អំពី​របៀបចូលប្រើ។ ប្រសិន​បើ​អ្នក​មិន​បាន​ទទួល​អ៊ីមែល​ទេ សូម​មើល​នៅ​ក្នុង​សឺមី​កាកសំណល់ ឬ​សឺមី​ស្ប៉ាម។ បើ​អ្នក​នៅ​តែ​មិន​បាន​ទទួល​អ៊ីមែល​ក្នុង​រយៈ​ពេល​មួយ​ម៉ោង អ្នក​អាច​<a href="%4$s">កំណត់​ពាក្យ​សម្ងាត់​របស់​អ្នក​ឡើង​វិញ</a>បាន។','You can create a %s file through a web interface, but this doesn\'t work for all server setups. The safest way is to manually create the file.'=>'អ្នក​អាច​បង្កើត​ឯកសារ %s តាមទំព័រ​វេប​បាន ប៉ុន្តែ​វា​មិន​ដើរ​គ្រប់​ម៉ាស៊ីន​បម្រើ​ឡើយ។ វិធី​ដែល​សុវត្ថិភាព​ជាង​គេ គឺ​បង្កើត​ឯកសារ​នោះ​ដោយ​ដៃ។','Your account has been activated. You may now <a href="%1$s">log in</a> to the site using your chosen username of &#8220;%2$s&#8221;. Please check your email inbox at %3$s for your password and login instructions. If you do not receive an email, please check your junk or spam folder. If you still do not receive an email within an hour, you can <a href="%4$s">reset your password</a>.'=>'គណនី​រប