n email.'=>'តម្លៃនៃ key ពុំដូចគ្នាត្រូវបានរកឃើញ។ សូមចុចលើតំណដែលបានផ្ញើចូលក្នុងអ៊ីមែលសម្រាប់បើកឲ្យដំណើការរបស់អ្នក។','Recovery Mode &#8212; %s'=>'ទម្រង់ស្ដារឡើងវិញ &#8212; %s']];